    t[238] = "Allocate number of processor threads for building tunnels. If your processor supports hyperthreading or simultaneous multithreading, you may multiply the number of processor cores by 2 to get the maximum number of threads to allocate, otherwise number of processor cores = maximum number of threads available. Note that you may wish to allocate less than the theoretical maximum to ensure you have headroom for other tasks.";
    t[239] = "Aloca\u021bi num\u0103rul de thread-uri de procesor pentru construirea tunelurilor. Dac\u0103 procesorul dvs. suport\u0103 hyperthreading sau multitasking simultan, pute\u021bi \u00eenmul\u021bi num\u0103rul de nuclee ale procesorului cu 2 pentru a ob\u021bine num\u0103rul maxim de thread-uri pe care s\u0103 le aloca\u021bi, altfel num\u0103rul de nuclee ale procesorului = num\u0103rul maxim de thread-uri disponibile. Re\u021bine\u021bi c\u0103 este posibil s\u0103 dori\u021bi s\u0103 aloca\u021bi mai pu\u021bin dec\u00e2t maximul teoretic pentru a v\u0103 asigura c\u0103 ave\u021bi spa\u021biu liber pentru alte sarcini.";
