    t[364] = "When a new service tunnel is created, or a service is run for the first time (e.g. the default jetty webserver, plugins), a private encryption key is created which essentially controls the ownership of address. This is usually named <code>&hellip;privKey.dat</code>, or <code>eepPriv.dat</code>, though it's a good idea to change the name to indicate the service it belongs to and then respecify it in the Tunnel Manager server settings. This .dat file should be backed up safely; lose it and you will lose ownership and control of your hostname!";
    t[365] = "Atunci c\u00e2nd este creat un nou tunel de serviciu sau c\u00e2nd este rulat un serviciu pentru prima dat\u0103 (de exemplu, serverul web implicit jetty, modulele), se creeaz\u0103 o cheie privat\u0103 de criptare care controleaz\u0103 \u00een mod esen\u021bial proprietatea adresei. Aceasta este de obicei numit\u0103 <code>&hellip;privKey.dat</code> sau <code>eepPriv.dat</code>, iar este o idee bun\u0103 s\u0103 schimba\u021bi numele pentru a indica serviciul la care apar\u021bine \u0219i apoi s\u0103-l specifica\u021bi din nou \u00een set\u0103rile serverului Tunnel Manager. Acest fi\u0219ier .dat ar trebui s\u0103 fie f\u0103cut backup \u00een siguran\u021b\u0103; dac\u0103 \u00eel pierde\u021bi, ve\u021bi pierde proprietatea \u0219i controlul numelui gazd\u0103!";
    t[368] = "This setting allows configuration of the maximum number of files per torrent I2PSnark will permit, when downloading or creating a torrent. Note that substantially increasing this value from the default of 2000 files may require additional configuration on the host system to increase the maximum number of open files the operating system will permit (e.g. <code>ulimit -n</code> on Linux). To change, add to I2PSnark's configuration file <code>i2psnark.config</code>. [Restart of I2PSnark or router required]";
    t[369] = "Aceast\u0103 setare permite configurarea num\u0103rului maxim de fi\u0219iere pe torrent pe care I2PSnark \u00eel va permite, \u00een momentul desc\u0103rc\u0103rii sau cre\u0103rii unui torrent. Re\u021bine\u021bi c\u0103 cre\u0219terea semnificativ\u0103 a acestei valori fa\u021b\u0103 de valoarea implicit\u0103 de 2000 de fi\u0219iere poate necesita o configurare suplimentar\u0103 pe sistemul gazd\u0103 pentru a cre\u0219te num\u0103rul maxim de fi\u0219iere deschise pe care sistemul de operare \u00eel va permite (de exemplu, <code>ulimit -n</code> pe Linux). Pentru a efectua modificarea, ad\u0103uga\u021bi \u00een fi\u0219ierul de configurare a I2PSnark <code>i2psnark.config</code>. [Este necesar\u0103 repornirea I2PSnark sau a routerului]";
    t[370] = "Configure router bandwidth allocation";
