    t[616] = "Bonuses may be positive or negative, and affect the peer's inclusion in Fast and High Capacity tiers. Fast peers are used for client tunnels, and High Capacity peers are used for some exploratory tunnels.";
    t[617] = "Bonusurile pot fi pozitive sau negative \u0219i afecteaz\u0103 includerea peer-ului \u00een nivelurile Fast \u0219i High Capacity. Peer-urile rapide sunt utilizate pentru tunelurile client, iar peer-urile de mare capacitate sunt utilizate pentru unele tuneluri de explorare.";
    t[618] = "Yes";
    t[619] = "Da";
    t[620] = "While I2P will work fine in this configuration, if you really have over 128KBps of bandwidth to share, it will be much more helpful to the network if you open your firewall.";
    t[621] = "\u00cen timp ce I2P va func\u021biona bine \u00een aceast\u0103 configura\u021bie, dac\u0103 ave\u021bi \u00eentr-adev\u0103r peste 128KBps de l\u0103\u021bime de band\u0103 pentru partajare, acesta va fi mult mai util la re\u021beau\u0103 dac\u0103 deschide\u021bi firewall-ul.";
    t[622] = "A command-line application supplied with I2P that is used to request URL resources, similar to <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> or <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a>. Eepget is also used internally by the router, for example to reseed from remote hosts. By default, eepget uses the HTTP proxy on <code>127.0.0.1:4444</code>.";
    t[623] = "O aplica\u021bie de linie de comand\u0103 furnizat\u0103 cu I2P care este utilizat\u0103 pentru a solicita resurse URL, similar\u0103 cu <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> sau <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a>. Eepget este, de asemenea, utilizat intern de router, de exemplu pentru resem\u0103narea de pe gazde \u00eendep\u0103rtate. \u00cen mod implicit, eepget folose\u0219te proxy-ul HTTP pe <code>127.0.0.1:4444</code>.";
