    t[722] = "Javadocs";
    t[723] = "Javadocs";
    t[724] = "An eepsite is a website that is hosted anonymously on the I2P network - you can access it by configuring your web browser to use I2P's HTTP proxy (see above) and browsing to the <code>.i2p</code> suffixed website (e.g. <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). Also ensure your browser is configured to resolve DNS remotely when using the proxy to avoid DNS leaks.";
    t[725] = "Un eepsite este un site web g\u0103zduit \u00een mod anonim \u00een re\u021beaua I2P - \u00eel pute\u021bi accesa configur\u00e2nd browserul dvs. web s\u0103 utilizeze proxy-ul HTTP I2P (vezi mai sus) \u0219i navig\u00e2nd la site-ul cu sufixul <code>.i2p </code> (de exemplu, <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). Asigura\u021bi-v\u0103 \u0219i c\u0103 browser-ul dvs. este configurat pentru a rezolva DNS-ul la distan\u021b\u0103 c\u00e2nd utiliza\u021bi proxy-ul pentru a evita scurgerile de DNS.";
