    t[737] = "Localiza\u021bi fi\u0219ierul de configurare: <code>00-net.i2p.router.web.RouterConsoleRunner-clients.config</code> in folderul <code>clients.config.d</code> din directorul de set\u0103ri I2P \u0219i edita\u021bi \u00een consecin\u021b\u0103:";
