    t[833] = "Executa\u021bi analiza pe toate routerele din NetDb";
    t[836] = "The first number is the number of peers your router has sent or received a message from in the last few minutes. This may range from 8-10 to several hundred, depending on your total bandwidth, shared bandwidth, and locally-generated traffic. The second number is the number of peers seen in the last hour or so. Do not be concerned if these numbers vary widely. <a href='/configstats#router.activePeers'>[Enable graphing]</a>.";
    t[837] = "Primul num\u0103r este num\u0103rul de perechi cu care router-ul dvs. a trimis sau a primit un mesaj \u00een ultimele c\u00e2teva minute. Acest num\u0103r poate varia de la 8-10 p\u00e2n\u0103 la c\u00e2teva sute, \u00een func\u021bie de l\u0103\u021bimea de band\u0103 total\u0103, l\u0103\u021bimea de band\u0103 \u00eemp\u0103rt\u0103\u0219it\u0103 \u0219i traficul generat local. Al doilea num\u0103r este num\u0103rul de perechi v\u0103zute \u00een ultima or\u0103 sau cam a\u0219a ceva. Nu v\u0103 \u00eengrijora\u021bi dac\u0103 aceste numere variaz\u0103 \u00een mod semnificativ. <a href='/configstats#router.activePeers'>[Activa\u021bi graficul]</a>.";
