    t[976] = "Externally reachable hostname or IP address";
    t[977] = "Gazd\u0103 sau adresa IP extern accesibila";
    t[980] = "Your webserver is running by default at <a href=http://127.0.0.1:7658/>http://127.0.0.1:7658</a>, but is not accessible by others until you start the <i>I2P Webserver</i> tunnel. After starting the tunnel, your site will be difficult for other people to find. You could just tell people the destination or the Base32 address, but thankfully I2P has an address book to store domain names, and various services where you can <a href=/help/hostnameregistration>register a new .i2p domain</a> for free.";
    t[981] = "Serverul dvs. web ruleaz\u0103 \u00een mod implicit la adresa <a href=http://127.0.0.1:7658/>http://127.0.0.1:7658</a>, dar nu poate fi accesat de c\u0103tre al\u021bii p\u00e2n\u0103 c\u00e2nd nu porni\u021bi tunelul <i>I2P Webserver</i>. Dup\u0103 pornirea tunelului, site-ul dvs. va fi dificil de g\u0103sit pentru alte persoane. Pute\u021bi spune oamenilor doar adresa destina\u021biei sau adresa Base32, dar \u00een mod norocos, I2P are o carte de adrese pentru a stoca numele de domenii \u0219i diferite servicii unde pute\u021bi <a href=/help/hostnameregistration>\u00eenregistra un nou domeniu .i2p</a> gratuit.";
