    t[1212] = "The skew (offset) of your computer's clock relative to the network-synced time (if known). I2P requires your computer's time be accurate. If the skew is more than a few seconds, please correct the problem by adjusting your computer's time. If I2P cannot connect to the internet, a reading of 0ms may be indicated. Note: This is only displayed in the <i>Router Information (advanced)</i> section. You may add this section to your Sidebar on the <a href='/configsidebar'>Sidebar Configuration page</a>.";
    t[1213] = "Dezechilibru (offset) ceasului calculatorului dvs. raportat la timpul sincronizat \u00een re\u021bea (dac\u0103 este cunoscut). I2P necesit\u0103 ca ora calculatorului s\u0103 fie exact\u0103. Dac\u0103 dezechilibrul este mai mare de c\u00e2teva secunde, v\u0103 rug\u0103m s\u0103 corecta\u021bi problema prin ajustarea orei calculatorului dvs. \u00cen cazul \u00een care I2P nu se poate conecta la internet, poate fi afi\u0219at\u0103 o citire de 0ms. Not\u0103: Aceasta este afi\u0219at\u0103 doar \u00een sec\u021biunea <i>Informa\u021bii despre router (avansat)</i>. Pute\u021bi ad\u0103uga aceast\u0103 sec\u021biune la bara lateral\u0103 pe pagina de <a href='/configsidebar'>Configurare Bar\u0103 lateral\u0103</a>.";
