    t[2107] = "Un router configurat s\u0103 func\u021bioneze \u00een mod ascuns nu va publica detaliile sale \u00een <i>Baza de date a re\u021belei</i> \u0219i nu va participa la rutarea traficului pentru alte rutere. Ruterele care opereaz\u0103 \u00een \u021b\u0103ri desemnate ca fiind stricte \u0219i cele configurate manual ruleaz\u0103 \u00een mod ascuns.";
