    t[2184] = "Help with reseeding";
    t[2185] = "Ajutor la re\u00eens\u0103m\u00e2n\u021bare";
    t[2188] = "The following threshold definition <i class=example>180/60</i> specifies that the same remote destination is allowed to make 179 connection attempts during a 60 second period. If it makes one more attempt within the same period, the threshold will be breached and further connection attempts will be rejected until the end of the period:";
    t[2189] = "Defini\u021bia urm\u0103toare a limitei <i class=example>180/60</i> specific\u0103 c\u0103 aceea\u0219i destina\u021bie \u00eendep\u0103rtat\u0103 are voie s\u0103 fac\u0103 179 de \u00eencerc\u0103ri de conectare \u00eentr-o perioad\u0103 de 60 de secunde. Dac\u0103 face \u00eenc\u0103 o \u00eencercare \u00een aceea\u0219i perioad\u0103, limita va fi \u00eenc\u0103lcat\u0103 \u0219i \u00eencerc\u0103rile ulterioare de conectare vor fi respinse p\u00e2n\u0103 la sf\u00e2r\u0219itul perioadei:";
    t[2190] = "config home";
