    t[2206] = "Version";
    t[2207] = "Versiune";
    t[2210] = "I2P selects a random port between 9000 and 31000 to communicate with other routers when the program is run for the first time, or when your external IP address changes when running in <a href=/confignet#ipchange>Laptop Mode</a>. The <a href=/confignet#udpconfig>selected port</a> is shown on the <a href=/confignet>Network Configuration page</a>.";
    t[2211] = "I2P selecteaz\u0103 un port aleatoriu \u00eentre 9000 \u0219i 31000 pentru a comunica cu alte rutere atunci c\u00e2nd programul este rulat pentru prima dat\u0103 sau atunci c\u00e2nd adresa IP extern\u0103 se schimb\u0103 atunci c\u00e2nd ruleaz\u0103 \u00een modul Laptop. Portul <a href=/confignet#udpconfig>selectat</a> este afi\u0219at \u00een pagina de <a href=/confignet>configurare a re\u021belei</a>.";
    t[2212] = "Message send rate (B/s)";
    t[2213] = "Rata de trimitere a mesajelor (B/s)";
    t[2214] = "Update or check already in progress";
    t[2215] = "Actualizarea sau verificarea sunt deja \u00een curs de desf\u0103\u0219urare";
    t[2218] = "Log date format";
    t[2219] = "Format dat\u0103 jurnal:";
    t[2226] = "Less than 256MB allocated to the JVM";
    t[2227] = "Mai pu\u021bin de 256MB alocate JVM-ului";
    t[2230] = "Average closest floodfill distance";
    t[2231] = "Cea mai apropiat\u0103 distan\u021b\u0103 medie de inundare";
    t[2232] = "It will take at least 10 minutes from your router starting for it to accept building participating tunnels in order to ensure your router is stable and successfully bootstrapped to the network.";
    t[2233] = "Este nevoie de cel pu\u021bin 10 minute de la pornirea routerului pentru ca acesta s\u0103 accepte construirea de tuneluri participative pentru a se asigura c\u0103 routerul t\u0103u este stabil \u0219i conexiunea la re\u021bea este realizat\u0103 cu succes.";
    t[2234] = "Last Heard From";
    t[2235] = "Ultima dat\u0103 c\u00e2nd am auzit de la";
    t[2236] = "midnight";
    t[2237] = "miezul nop\u021bii";
    t[2246] = "A gentle introduction to I2P";
    t[2247] = "O introducere bl\u00e2nd\u0103 \u00een I2P";
    t[2250] = "How long jobs are waiting before execution. The job queue is listed on the <a href='/jobs'>Jobs page</a>. Unfortunately, there are several other job queues in the router that may be congested, and their status is not available in the router console. The job lag should generally be zero. If it is consistently higher than 500ms, your computer is very slow, your network is experiencing connectivity issues, or the router has serious problems. <a href='/configstats#jobQueue.jobLag'>[Enable graphing]</a>.";
    t[2251] = "C\u00e2t timp a\u0219teapt\u0103 sarcinile \u00eenainte de execu\u021bie. Coada de sarcini este listat\u0103 pe <a href='/jobs'>pagina de sarcini</a>. Din p\u0103cate, exist\u0103 \u0219i alte cozi de sarcini \u00een router care pot fi aglomerate \u0219i starea lor nu este disponibil\u0103 \u00een consola routerului. \u00cent\u00e2rzierea sarcinilor trebuie s\u0103 fie \u00een general zero. Dac\u0103 este \u00een mod constant mai mare de 500 ms, calculatorul t\u0103u func\u021bioneaz\u0103 foarte \u00eencet, re\u021beaua ta are probleme de conectivitate sau routerul are probleme serioase. <a href='/configstats#jobQueue.jobLag'>[Activeaz\u0103 graficul]</a>.";
    t[2252] = "Configure I2P Updates";
    t[2253] = "Configura\u021bi Actualiz\u0103rile I2P";
    t[2254] = "Before you tell the world about your new website, you should add some content. Go to the server's root directory <a href=#rootdir>listed above</a> and replace the <i>index.html</i> redirect page with your own content. If you need a template for a basic site, feel free to adapt <a href=http://127.0.0.1:7658/help/pagetemplate.html>this page</a>. If you're returned to this page after editing the content, try clearing your browser's web cache.";
    t[2255] = "\u00cenainte de a informa lumea despre noul dumneavoastr\u0103 site web, ar trebui s\u0103 ad\u0103uga\u021bi con\u021binut. Accesa\u021bi directorul de baz\u0103 al serverului <a href=#rootdir>enumerat mai sus</a> \u0219i \u00eenlocui\u021bi pagina de redirec\u021bionare <i>index.html</i> cu propriul con\u021binut. Dac\u0103 ave\u021bi nevoie de un \u0219ablon pentru un site de baz\u0103, nu ezita\u021bi s\u0103 adapta\u021bi <a href=http://127.0.0.1:7658/help/pagetemplate.html>aceast\u0103 pagin\u0103</a>. Dac\u0103 reveni\u021bi la aceast\u0103 pagin\u0103 dup\u0103 editarea con\u021binutului, \u00eencerca\u021bi s\u0103 \u0219terge\u021bi memoria cache a browserului web.";
