    t[2294] = "The <i class=example>default</i> threshold applies to any remote destination not explicitly listed in the definition or in any of the referenced files. To set a default threshold use the keyword <i class=example>default</i>.";
    t[2295] = "Limita <i class=example>implicit\u0103</i> se aplic\u0103 oric\u0103rei destina\u021bii \u00eendep\u0103rtate care nu este enumerat\u0103 \u00een mod explicit \u00een defini\u021bie sau \u00een oricare dintre fi\u0219ierele referite. Pentru a seta o limit\u0103 implicit\u0103, utiliza\u021bi cuv\u00e2ntul cheie <i class=example>default</i>.";
