    t[2312] = "If your router has 10 or more active peers, everything is fine. The router should maintain connections to a few peers at all times. The best way to stay \"better-connected\" to the network is to <a href=/config>share more bandwidth</a>.";
    t[2313] = "Dac\u0103 routerul dvs. are 10 sau mai mul\u021bi peeri activi, totul este \u00een regul\u0103. Routerul ar trebui s\u0103 men\u021bin\u0103 conexiuni cu c\u00e2\u021biva peeri \u00een orice moment. Cel mai bun mod de a r\u0103m\u00e2ne \"conectat mai bine\" la re\u021bea este s\u0103 <a href=/config>distribui\u021bi mai mult\u0103 l\u0103\u021bime de band\u0103</a>.";
