    t[2370] = "Glossary";
    t[2371] = "Glosar";
    t[2376] = "To obtain your own hostname, I2P domain registrars such as <a href=http://stats.i2p/i2p/addkey.html target=_blank rel=noreferrer class=sitelink>stats.i2p</a> or <a href=http://reg.i2p/ target=_blank rel=noreferrer class=sitelink>reg.i2p</a> provide registration services that allow you to register and manage an .i2p hostname or sub-domain which will then be propagated across the network. Some registration sites will require the <i>B64 destination address</i> for the tunnel/service you wish to associate with a hostname, which you should copy from the <i>Local destination</i> section on the <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>.";
    t[2377] = "Pentru a ob\u021bine propriul dvs. nume de gazd\u0103, registraturile de domenii I2P precum <a href=http://stats.i2p/i2p/addkey.html target=_blank rel=noreferrer class=sitelink>stats.i2p</a> sau <a href=http://reg.i2p/ target=_blank rel=noreferrer class=sitelink>reg.i2p</a> furnizeaz\u0103 servicii de \u00eenregistrare care v\u0103 permit s\u0103 \u00eenregistra\u021bi \u0219i s\u0103 administra\u021bi un nume de gazd\u0103 sau subdomeniu .i2p care apoi va fi propagat \u00een \u00eentreaga re\u021bea. Unele site-uri de \u00eenregistrare vor cere <i>adresa de destina\u021bie B64</i> pentru tunel/serviciu pe care dori\u021bi s\u0103 \u00eel asocia\u021bi cu un nume de gazd\u0103, pe care trebuie s\u0103 o copia\u021bi din sec\u021biunea <i>destina\u021bie local\u0103</i> de pe <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>pagina de configurare a managerului tunel</a>.";
