    t[2482] = "This indicates the amount of RAM I2P is using, and the total amount available, allocated by Java. If the usage is consistently high relative to the available RAM, this may indicate that you need to increase the ram allocated to the JVM. You can allocate more RAM by editing your <code>wrapper.config</code> file which is normally located in the I2P application directory. You will need to edit the <code>wrapper.java.maxmemory</code> parameter, which by default is set to 256(MB) for I2P, or 384 for I2P+. Note: if the memory bar is enabled, the memory entry in the router info section will be suppressed.";
    t[2483] = "Aceasta indic\u0103 cantitatea de memorie RAM pe care o utilizeaz\u0103 I2P \u0219i cantitatea total\u0103 disponibil\u0103, alocat\u0103 de Java. Dac\u0103 utilizarea este \u00een mod constant ridicat\u0103 \u00een raport cu RAM-ul disponibil, acest lucru poate indica faptul c\u0103 trebuie s\u0103 m\u0103ri\u021bi RAM-ul alocat pentru JVM. Pute\u021bi aloca mai mult\u0103 memorie RAM edit\u00e2nd fi\u0219ierul dumneavoastr\u0103 <code>wrapper.config</code>, care de obicei se g\u0103se\u0219te \u00een directorul aplica\u021biei I2P. Va trebui s\u0103 edita\u021bi parametrul <code>wrapper.java.maxmemory</code>, care implicit este setat la 256(MB) pentru I2P sau 384 pentru I2P+. Not\u0103: dac\u0103 bara de memorie este activat\u0103, intrarea de memorie din sec\u021biunea de informa\u021bii a routerului va fi suprimat\u0103.";
