    t[2536] = "Under <i>Configure Proxy Access to Internet</i> select the <i>Manual proxy configuration</i> option.";
    t[2537] = "Sub <i>Configurare acces proxy la internet</i>, selecteaz\u0103 op\u021biunea <i>Configurare manual\u0103 a proxy-ului</i>.";
    t[2538] = "To serve your own static content, you only need to edit or replace the files in the webserver's root directory, and the site will be available on the I2P network after you've followed the instructions below. Additionally, cgi and python scripts can be run from the <code>cgi-bin</code> directory immediately above <code>docroot</code> if you have <a href=https://www.perl.org/about.html target=_blank rel=noreferrer class='sitelink external'>perl</a> and <a href=https://www.python.org/ target=_blank rel=noreferrer class='sitelink external'>python</a> installed.";
    t[2539] = "Pentru a servi con\u021binutul static propriu, trebuie doar s\u0103 edita\u021bi sau s\u0103 \u00eenlocui\u021bi fi\u0219ierele din directoriul r\u0103d\u0103cin\u0103 al serverului web, iar site-ul va fi disponibil \u00een re\u021beaua I2P dup\u0103 ce a\u021bi urmat instruc\u021biunile de mai jos. \u00cen plus, scripturile cgi \u0219i python pot fi rulate din directorul <code>cgi-bin</code>, imediat deasupra directorului <code>docroot</code>, dac\u0103 ave\u021bi instalat <a href=https://www.perl.org/about.html target=_blank rel=noreferrer class='sitelink external'>perl</a> \u0219i <a href=https://www.python.org/ target=_blank rel=noreferrer class='sitelink external'>python</a>.";
