    t[2578] = "Many of the stats on the sidebar may be <a href='/configstats'>configured</a> to be <a href='/graphs'>graphed</a> for further analysis. You may also customize the sections that appear on the Sidebar and their positioning on the <a href='/configsidebar'>Sidebar Configuration page</a>.";
    t[2579] = "Multe dintre statisticile de pe bara lateral\u0103 pot fi <a href='/configstats'>configurate</a> pentru a fi <a href='/graphs'>afisate sub form\u0103 de grafice</a> \u00een scopul analizei ulterioare. De asemenea, pute\u021bi personaliza sec\u021biunile care apar pe bara lateral\u0103 \u0219i pozi\u021bionarea acestora pe pagina de <a href='/configsidebar'>Configurare a bara lateral\u0103</a>.";
    t[2582] = "This tunnel-specific setting allows you to enable or disable replies to pings sent to servers hosted by the router. To disable pings, you must add the line <code>i2p.streaming.answerPings=false</code> to the <i>Custom Options</i> section for the server's configuration in the Tunnel Manager.";
    t[2583] = "Aceast\u0103 setare specific\u0103 tunelului v\u0103 permite s\u0103 activa\u021bi sau dezactiva\u021bi r\u0103spunsuri la ping-urile trimise la serverele g\u0103zduite de router. Pentru a dezactiva ping-urile, trebuie s\u0103 ad\u0103uga\u021bi linia <code>i2p.streaming.answerPings=false</code> \u00een sec\u021biunea <i>Op\u021biuni personalizate</i> pentru configura\u021bia serverului \u00een Managerul de Tunel.";
    t[2592] = "Max";
    t[2593] = "Max";
    t[2598] = "If you wish to install unsigned (.zip) I2P updates, this should be added to your <code>router.config</code> file unless you have already configured <code>routerconsole.advanced=true</code>, in which case this option is already provisioned. Note: as of I2P+ 0.9.48+, installation of <a href=/configupdate#i2pupdates>unsigned updates</a> is enabled by default.";
    t[2599] = "Dac\u0103 dori\u021bi s\u0103 instala\u021bi actualiz\u0103ri I2P nesemnate (.zip), aceasta trebuie ad\u0103ugat\u0103 \u00een fi\u0219ierul dvs. <code>router.config</code> cu excep\u021bia cazului \u00een care a\u021bi configurat deja <code>routerconsole.advanced=true</code>, caz \u00een care aceast\u0103 op\u021biune este deja preconfigurat\u0103. Not\u0103: \u00eencep\u00e2nd cu I2P+ 0.9.48+, instalarea <a href=/configupdate#i2pupdates>actualiz\u0103rilor nesemnate</a> este activat\u0103 \u00een mod implicit.";
