    t[2616] = "If you know and trust somebody that runs I2P, ask them to send you a reseed file generated using this page in their router console. Then, select the <i>Reseed from file</i> option on the {0} using the file you received.";
    t[2617] = "Dac\u0103 cunoa\u0219te\u021bi \u0219i ave\u021bi \u00eencredere \u00een cineva care utilizeaz\u0103 I2P, cere\u021bi-le s\u0103 v\u0103 trimit\u0103 un fi\u0219ier de resedare generat utiliz\u00e2nd aceast\u0103 pagin\u0103 \u00een consola ruterului lor. Apoi, selecta\u021bi op\u021biunea <i>Reseed din fi\u0219ier</i> \u00een {0} utiliz\u00e2nd fi\u0219ierul pe care l-a\u021bi primit.";
