    t[2696] = "This setting (in seconds) allows you to override the delay between runs of the Peer Exploration Job which attempts to locate new peers to add to the NetDb. The job will run every 80 seconds by default, or if the router is experiencing job or message lag, every 3 minutes. If the size of the NetDb reaches 4000 peers, the pause will increase to 15 minutes. You may wish to increase the delay if your NetDb is well-populated (over 2000 peers), or if you wish to reduce overall bandwidth usage. Note: For Floodfill routers, this job does not run.";
    t[2697] = "Aceast\u0103 setare (\u00een secunde) v\u0103 permite s\u0103 anula\u021bi \u00eent\u00e2rzierea \u00eentre rul\u0103rile Jobului de explorare a perechilor care \u00eencearc\u0103 s\u0103 g\u0103seasc\u0103 noi colegi pentru a ad\u0103uga la NetDb. Jobul ruleaz\u0103 la fiecare 80 de secunde \u00een mod implicit sau, dac\u0103 routerul experimenteaz\u0103 o \u00eent\u00e2rziere a jobului sau a mesajelor, la fiecare 3 minute. Dac\u0103 dimensiunea NetDb atinge 4000 de colegi, pauza va cre\u0219te la 15 minute. Pute\u021bi dori s\u0103 m\u0103ri\u021bi \u00eent\u00e2rzierea dac\u0103 NetDb este bine populat (peste 2000 de colegi) sau dac\u0103 dori\u021bi s\u0103 reduce\u021bi utilizarea global\u0103 a l\u0103\u021bimii de band\u0103. Not\u0103: Pentru ruterele Floodfill, acest job nu ruleaz\u0103.";
    t[2698] = "Current";
    t[2699] = "Actual";
    t[2720] = "A website hosted on the I2P network. By default, a <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>Jetty webserver</a> is configured and running on <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2721] = "Un site web g\u0103zduit \u00een re\u021beaua I2P. \u00cen mod implicit, un server web <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>Jetty</a> este configurat \u0219i ruleaz\u0103 la adresa <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2722] = "Can be disabled or changed in the <a href=/i2ptunnelmgr>Tunnel Manager</a>. Can also be configured to bind to a specific interface or all interfaces.";
    t[2723] = "Poate fi dezactivat sau modificat \u00een <a href=/i2ptunnelmgr>Managerul Tunelurilor</a>. Poate fi configurat \u0219i s\u0103 se lege de o interfa\u021b\u0103 specific\u0103 sau de toate interfe\u021bele.";
    t[2728] = "I2P+ Service now enabled on system start";
    t[2729] = "Serviciul I2P+ este acum activat la pornirea sistemului";
    t[2748] = "Computer related news aggregation";
