    t[2752] = "Same IP as us";
    t[2753] = "Acela\u0219i IP ca \u0219i noi";
    t[2754] = "You may create a new router family here. Once you have created the family, you may export the family key file and share with other routers in your nominated family.";
    t[2755] = "Pute\u021bi crea o nou\u0103 familie de routere aici. Dup\u0103 ce a\u021bi creat familia, pute\u021bi exporta fi\u0219ierul cheie de familie \u0219i pute\u021bi partaja cu alte routere din familia dvs. nominalizat\u0103.";
    t[2756] = "Tunnels peer has agreed to participate in";
    t[2757] = "Colegiul de tuneluri a fost de acord s\u0103 participe";
    t[2758] = "Advanced Lookup";
    t[2759] = "C\u0103utare avansat\u0103";
    t[2766] = "In order to access websites hosted on I2P, and optionally use the default outproxy to connect to websites on clearnet, you will need to configure your browser to use the I2P HTTP proxy, by default running on <code>127.0.0.1 port 4444</code>. Most browsers offer an option to configure your proxy; in this mini-tutorial we'll focus on Firefox.";
    t[2767] = "Pentru a accesa site-urile web g\u0103zduite pe I2P \u0219i op\u021bional pentru a utiliza proxy-ul implicit pentru a te conecta la site-uri pe clearnet, va trebui s\u0103 configurezi browser-ul pentru a utiliza proxy-ul HTTP al I2P, care ruleaz\u0103 \u00een mod implicit pe <code>127.0.0.1 portul 4444</code>. Majoritatea browserelor ofer\u0103 o op\u021biune pentru a configura proxy-ul; \u00een acest mini-tutorial ne vom concentra pe Firefox.";
    t[2776] = "Close to us";
    t[2777] = "Aproape de noi";
    t[2790] = "I2P+ Router Sitemap";
    t[2791] = "Harta site-ului routerului I2P";
    t[2794] = "Downloaded plugin version {0} is not newer than installed plugin";
    t[2795] = "Versiunea plug-inului desc\u0103rcat {0} nu este mai nou\u0103 dec\u00e2t plugin-ul instalat";
    t[2796] = "Streaming radio service";
    t[2797] = "Serviciu radio de streaming";
    t[2798] = "I2P+ functions best when you can accurately reflect the speed of your network connection in the <a href=/config>bandwidth configuration section</a>. By default I2P+ is configured with some fairly conservative values that will not suit many use cases, so please take time to review these settings and correct where necessary. The more bandwidth you allocate, <i>specifically</i> upstream bandwidth, the more you will benefit from the network.";
    t[2799] = "I2P+ func\u021bioneaz\u0103 cel mai bine atunci c\u00e2nd pute\u021bi reflecta cu exactitate viteza conexiunii dvs. la re\u021bea \u00een sec\u021biunea de <a href=/config>configurare a l\u0103\u021bimii de band\u0103</a>. \u00cen mod implicit, I2P+ este configurat cu unele valori destul de conservatoare care nu se potrivesc multor cazuri de utilizare, a\u0219a c\u0103 v\u0103 rug\u0103m s\u0103 v\u0103 lua\u021bi timp s\u0103 evalua\u021bi aceste set\u0103ri \u0219i s\u0103 le corecta\u021bi dac\u0103 este necesar. Cu c\u00e2t aloca\u021bi mai mult\u0103 l\u0103\u021bime de band\u0103, \u00een special \u00een sens ascendent, cu at\u00e2t ve\u021bi beneficia mai mult de re\u021bea.";
    t[2810] = "Transit by Peer";
    t[2811] = "Tranzit prin Peer";
    t[2812] = "Hidden Mode";
    t[2813] = "Mod Ascuns";
    t[2814] = "Plugin requires Jetty version {0} or lower";
    t[2815] = "Plugin necesit\u0103 Jetty versiunea {0} sau mai mic\u0103";
    t[2822] = "The proxy may be remotely hosted or a service running on your computer (localhost/127.0.0.1).";
    t[2823] = "Proxy-ul poate fi g\u0103zduit de la distan\u021b\u0103 sau un serviciu care ruleaz\u0103 pe computerul t\u0103u (localhost/127.0.0.1).";
    t[2824] = "Events in peak period";
    t[2825] = "Evenimente \u00een perioada de v\u00e2rf";
    t[2838] = "Router Console &amp; WebApps Display Language";
    t[2839] = "Limb\u0103 de afi\u0219are consol\u0103 router \u0219i aplica\u021bii web";
    t[2844] = "What to do in the event I2P+ isn't working";
    t[2845] = "Ce s\u0103 faci \u00een cazul \u00een care I2P+ nu func\u021bioneaz\u0103";
    t[2856] = "ANONYMITY WARNING - Settings include 1-hop tunnels.";
    t[2857] = "AVERTIZARE ANONIMITATE - Set\u0103rile includ tunele cu 1-hop.";
    t[2858] = "I2P IRC Network";
    t[2859] = "Re\u021beaua IRC I2P";
    t[2864] = "pixels wide";
    t[2865] = "l\u0103\u021bime pixelilor";
    t[2882] = "The I2P Network Protocol (I2NP) manages the routing and mixing of messages between routers, in addition to the transport selection (where more than one is supported) when communicating with a peer. For more information, see the <a href=https://geti2p.net/en/docs/protocol/i2np class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[2883] = "Protocolul de re\u021bea I2P (I2NP) gestioneaz\u0103 rutarea \u0219i amestecarea mesajelor \u00eentre rutere, \u00een plus fa\u021b\u0103 de selectarea transportului (unde este sus\u021binut mai mult de unul) atunci c\u00e2nd comunica\u021bi cu un partener. Pentru mai multe informa\u021bii, consulta\u021bi <a href=https://geti2p.net/en/docs/protocol/i2np class='sitelink external' target=_blank rel=noreferrer>documenta\u021bia online</a>.";
    t[2884] = "Expired {0} ago";
    t[2885] = "Expirat \u00een urm\u0103 cu {0}";
    t[2892] = "Your router's status on accepting or rejecting requests from other routers to build a participating tunnel through your router. Your router may accept all requests, accept or reject a percentage of requests, or reject all requests for a number of reasons, to control the bandwidth and CPU demands and maintain capacity for local clients. <b>Note";
    t[2893] = "Starea routerului t\u0103u referitoare la acceptarea sau respingerea cererilor din partea altor routere de a construi un tunel participativ prin routerul t\u0103u. Router-ul t\u0103u poate accepta toate cererile, accepta sau respinge un procentaj de cereri sau respinge toate cererile din diverse motive, pentru a controla cerin\u021bele de l\u0103\u021bime de band\u0103 \u0219i de procesare CPU \u0219i a men\u021bine capacitatea pentru clien\u021bii locali. <b>Not\u0103";
    t[2902] = "Please contact a known trustworthy friend who has a running I2P router, and ask them for help with reseeding your I2P router. Request that they send you a reseed file exported from their running I2P router. It is vital that the file is exchanged over a secure channel, e.g. encrypted to avoid external tampering (PGP Sign, Encrypt and Verified with a trusted public key). The file itself is unsigned, so please accept files only from known trusted friends. Never import a reseed file if you cannot verify its source.";
    t[2903] = "V\u0103 rug\u0103m s\u0103 solicita\u021bi ajutor unui prieten cunoscut \u0219i de \u00eencredere care are un router I2P func\u021bional pentru a v\u0103 ajuta cu sem\u0103natul routerului dvs. I2P. Solicita\u021bi-i s\u0103 v\u0103 trimit\u0103 un fi\u0219ier de recoltare exportat de la routerul lor I2P func\u021bional. Este vital ca schimbul de fi\u0219iere s\u0103 se realizeze printr-un canal securizat, de exemplu criptat pentru a evita interferen\u021bele externe (PGP Sign, Encrypt \u0219i Verificat cu o cheie public\u0103 de \u00eencredere). Fi\u0219ierul \u00een sine nu este semnat, a\u0219a c\u0103 v\u0103 recomand\u0103m s\u0103 accepta\u021bi doar fi\u0219iere de la prieteni de \u00eencredere cunoscu\u021bi. Nu importa\u021bi niciodat\u0103 un fi\u0219ier de recoltare dac\u0103 nu pute\u021bi verifica sursa acestuia.";
    t[2916] = "Last Good Send";
    t[2917] = "Ultima transmitere reu\u0219it\u0103";
    t[2918] = "Delete this value to disable";
    t[2919] = "\u0218terge\u021bi aceast\u0103 valoare pentru a dezactiva";
    t[2920] = "You can use a recorder in one tunnel that writes to a file that another tunnel, or multiple tunnels, can use for throttling. These files can also be edited by hand.";
    t[2921] = "Pute\u021bi utiliza un \u00eenregistr\u0103tor \u00eentr-un tunel care scrie \u00eentr-un fi\u0219ier pe care un alt tunel, sau mai multe tuneluri, le poate utiliza pentru limitare. Aceste fi\u0219iere pot fi de asemenea editate manual.";
    t[2924] = "Router running a non-native, software emulated version of the Java BigInteger library";
    t[2925] = "Routerul ruleaz\u0103 o versiune necompatibil\u0103, emulat\u0103 software, a librariei Java BigInteger";
    t[2928] = "Country";
