    t[2956] = "The Java web applications listed below are started by the webConsole client and run in the same JVM as the router. They are usually web applications accessible through the router console. They may be complete applications (e.g. i2psnark), front-ends to another client or application which must be separately enabled (e.g. susidns, i2ptunnel), or have no web interface at all (e.g. addressbook).";
    t[2957] = "Aplica\u021biile web Java enumerate mai jos sunt pornite de clientul WebConsole \u0219i se execut\u0103 \u00een acela\u0219i JVM ca \u0219i ruterul. Acestea sunt, de obicei, aplica\u021bii web accesibile prin consola routerului. Acestea pot fi aplica\u021bii complete (de exemplu, i2psnark), front-end-uri c\u0103tre un alt client sau aplica\u021bie care trebuie s\u0103 fie activat\u0103 separat (de exemplu, susidns, i2ptunnel) sau s\u0103 nu aib\u0103 interfa\u021b\u0103 web la toate (de exemplu, agenda de adrese).";
