    t[2978] = "This is the total number of peers that are known by your router. They are listed on the <a href='/netdb'>Network Database page</a>. This may range from under 100 to 1000 or more. This number is not the total size of the network; it may vary widely depending on your total bandwidth, shared bandwidth, and locally-generated traffic. I2P does not require a router to know every other router in the network.";
    t[2979] = "Acesta este num\u0103rul total de participan\u021bi pe care routerul dvs. \u00eei cunoa\u0219te. Ace\u0219tia sunt enumera\u021bi pe <a href='/netdb'>pagina Bazei de date de re\u021bea</a>. Aceasta poate varia de la sub 100 la 1000 sau mai mult. Acest num\u0103r nu reprezint\u0103 dimensiunea total\u0103 a re\u021belei; acesta poate varia \u00een mod semnificativ \u00een func\u021bie de l\u0103\u021bimea de band\u0103 total\u0103, l\u0103\u021bimea de band\u0103 partajat\u0103 \u0219i traficul generat local. I2P nu necesit\u0103 ca un router s\u0103 cunoasc\u0103 fiecare alt router din re\u021bea.";
