    t[3188] = "When set to true, additional functionality will be enabled in the console and the user will be able to edit settings directly on the <a href=/configadvanced>Advanced Configuration page</a>. Extra display options are provided in the <a href=/netdb>Network Database section</a>, including the <a href='/netdb?f=3'>Sybil Analysis tool</a>, and there are additional configuration options on the <a href=/configclients>Clients Configuration page</a>. This will also enable the installation of unsigned updates, manual configuration of the news URL, and additional sections on the sidebar.";
    t[3189] = "C\u00e2nd este setat\u0103 pe true, func\u021bionalit\u0103\u021bile suplimentare vor fi activate \u00een consol\u0103 \u0219i utilizatorul va putea edita set\u0103rile direct pe pagina de <a href=/configadvanced>Configurare avansat\u0103</a>. Op\u021biuni suplimentare de afi\u0219are sunt furnizate \u00een sec\u021biunea <a href=/netdb>Baz\u0103 de date a re\u021belei</a>, inclusiv <a href='/netdb?f=3'>Unelte de analiz\u0103 Sybil</a>, \u0219i exist\u0103 op\u021biuni suplimentare de configurare \u00een pagina de <a href=/configclients>Configurare clien\u021bi</a>. Aceasta va permite, de asemenea, instalarea de actualiz\u0103ri nesemnate, configurarea manual\u0103 a URL-ului de \u0219tiri \u0219i sec\u021biuni suplimentare \u00een bara lateral\u0103.";
