    t[3486] = "This is the number of peers your router has available for building client tunnels. It is generally in the range 8-30. Your fast peers are shown on the <a href='/profiles'>Profiles page</a>. <a href='/configstats#router.fastPeers'>[Enable graphing]</a>";
    t[3487] = "Acesta este num\u0103rul de perechi pe care router-ul dvs. le are disponibile pentru construirea tunelurilor de client. De obicei, este \u00een intervalul 8-30. Perechile rapide ale dvs. sunt afi\u0219ate pe <a href='/profiles'>pagina de profiluri</a>. <a href='/configstats#router.fastPeers'>[Activa\u021bi graficul]</a>";
    t[3488] = "Click the <i>Reseed from File</i> button";
    t[3489] = "Face\u021bi clic pe butonul <i>Reseed from File</i>";
    t[3490] = "A variant of onion routing that encrypts multiple messages together to make it more difficult for attackers to perform traffic analysis and to increase the speed of data transfer. For more information, see the <a href=https://geti2p.net/en/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[3491] = "O variant\u0103 a rut\u0103rii cu ceap\u0103 care cripteaz\u0103 mai multe mesaje \u00eempreun\u0103 pentru a face mai dificil ca atacatorii s\u0103 efectueze analize de trafic \u0219i pentru a cre\u0219te viteza de transfer de date. Pentru mai multe informa\u021bii, consulta\u021bi <a href=https://geti2p.net/en/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>documenta\u021bia online</a>.";
    t[3494] = "How to Harden Your WordPress Site";
    t[3495] = "Cum s\u0103 v\u0103 \u00eent\u0103ri\u021bi site-ul WordPress";
    t[3496] = "I2P Internals";
    t[3497] = "Structurile interne I2P ";
    t[3500] = "By default, I2P is supplied with a webserver to host your own anonymized website (traditionally referred to as an <i>eepsite</i>). Both the site and the I2P Router Console are running on a streamlined version of <a href='https://en.wikipedia.org/wiki/Jetty_(web_server)' target=_blank rel=noreferrer class='sitelink external'>Jetty</a>, customized for I2P.";
    t[3501] = "\u00cen mod implicit, I2P este \u00eenzestrat cu un server web pentru a g\u0103zdui propriul site web anonimizat (tradi\u021bional cunoscut sub numele de <i>eepsite</i>). At\u00e2t site-ul, c\u00e2t \u0219i consola de rutare I2P ruleaz\u0103 pe o versiune simplificat\u0103 a <a href='https://en.wikipedia.org/wiki/Jetty_(web_server)' target=_blank rel=noreferrer class='sitelink external'>Jetty</a>, personalizat\u0103 pentru I2P.";
    t[3504] = "This setting allows you to exclude older routers from your NetDb. Routers older than the default or the value you set will be deleted from the NetDb and banned for the duration of the router session. By default, routers older than 0.9.20 are excluded. Note: starting with I2P+ version 0.9.46+, only routers running very recent versions are used for building local tunnels. [Restart required]";
    t[3505] = "Aceast\u0103 setare v\u0103 permite s\u0103 exclude\u021bi ruterele mai vechi din NetDb. Ruterele mai vechi de valoarea implicit\u0103 sau cea setat\u0103 vor fi \u0219terse din NetDb \u0219i interzise pe durata sesiunii ruterului. \u00cen mod implicit, sunt excluse ruterele mai vechi de 0.9.20. Not\u0103: \u00eencep\u00e2nd cu versiunea I2P+ 0.9.46+, sunt folosite numai rutere care ruleaz\u0103 versiunile recente pentru construirea tunelurilor locale. [Este necesar\u0103 repornirea]";
