    t[3547] = "Aceast\u0103 setare, \u00een milisecunde, anuleaz\u0103 limita implicit\u0103 de timp de procesare a mesajelor (indicat\u0103 ca <i> Message Delay </i> \u00een sec\u021biunea lateral\u0103 a Congestion) \u00eenainte ca routerul s\u0103 fie considerat congestionat \u0219i cererile de tunelare de tranzit s\u0103 fie respinse. [Implicit este de 750ms sau de 1500ms dac\u0103 routerul este marcat ca fiind lent]";
