    t[3624] = "This setting determines whether or not the router should use the provided <i>blocklist.txt</i> file and any user configured blocklists to enable banning of routers by hash or ip address. Ranges and net masks are supported for IPv4 but not IPv6. See the <i>blocklist.txt</i> in your I2P+ application directory for more info. [Enabled by default, restart required]";
    t[3625] = "Aceast\u0103 setare determin\u0103 dac\u0103 routerul ar trebui s\u0103 utilizeze fi\u0219ierul <i>blocklist.txt</i> furnizat \u0219i orice list\u0103 de blocare configurat\u0103 de utilizator pentru a permite interzicerea routerelor dup\u0103 hash sau adres\u0103 IP. Gama de adrese \u0219i m\u0103\u0219tile de re\u021bea sunt acceptate pentru IPv4, dar nu pentru IPv6. Consulta\u021bi fi\u0219ierul <i>blocklist.txt</i> din directorul aplica\u021biei I2P+ pentru mai multe informa\u021bii. [Activat \u00een mod implicit, necesit\u0103 repornire]";
