    t[3638] = "Outbound UDP on port 123, allowing replies: this is necessary for I2P's internal time sync (via SNTP - querying a random SNTP host in <code>pool.ntp.org</code> or <a href=/help/advancedsettings#ntpserverconfig>another server you specify</a>).";
    t[3639] = "UDP de ie\u0219ire pe portul 123, permi\u021b\u00e2nd r\u0103spunsuri: acest lucru este necesar pentru sincronizarea intern\u0103 a timpului I2P (prin SNTP - interogarea unui gazd\u0103 SNTP aleatoriu \u00een <code>pool.ntp.org</code> sau <a href=/help/advancedsettings#ntpserverconfig>un alt server specificat de tine</a>).";
