    t[3704] = "The router configuration options listed below are not available in the user interface, usually because they are rarely used or provide access to advanced settings that most users will not need. This is not a comprehensive list. Some settings will require a restart of the router to take effect. Note that all settings are case sensitive. You will need to edit your <code>router.config</code> file to add options, or, once you have added <code>routerconsole.advanced=true</code> to the router.config file, you may edit settings within the console on the <a href=/configadvanced>Advanced Configuration page</a>.";
    t[3705] = "Op\u021biunile de configurare a ruterului enumerate mai jos nu sunt disponibile \u00een interfa\u021ba utilizatorului, de obicei pentru c\u0103 sunt rareori utilizate sau ofer\u0103 acces la set\u0103ri avansate de care majoritatea utilizatorilor nu au nevoie. Aceasta nu este o list\u0103 cuprinz\u0103toare. Unele set\u0103ri vor necesita repornirea ruterului pentru a avea efect. Re\u021bine\u021bi c\u0103 toate set\u0103rile sunt sensibile la majuscule \u0219i la minuscule. Va trebui s\u0103 edita\u021bi fi\u0219ierul dvs. <code>router.config</code> pentru a ad\u0103uga op\u021biuni, sau, odat\u0103 ce a\u021bi ad\u0103ugat <code>routerconsole.advanced=true</code> fi\u0219ierului router.config, pute\u021bi edita set\u0103rile \u00een interiorul consolei de pe pagina <a href=/configadvanced>Configurare avansat\u0103</a>.";
