    t[3962] = "Some IRC clients are configured to disconnect from the server if there's been no communication with the server for a period of time, which can sometimes be problematic for I2P IRC if the <i>ping timeout</i> value is set too low. Setting the ping timeout value in your client to a high value (e.g. 320 seconds) will often result in a more robust connection to the network. In hexchat you can configure the value by typing <code>/set net_ping_timeout 320</code>. This will write the value to your <code>hexchat.conf</code> file.";
    t[3963] = "Unii clien\u021bi de IRC sunt configura\u021bi s\u0103 se deconecteze de la server dac\u0103 nu a existat nicio comunicare cu serverul o perioad\u0103 de timp, lucru care poate fi uneori problematic pentru I2P IRC dac\u0103 valoarea <i>ping timeout</i> este setat\u0103 prea mic\u0103. Setarea unei valori mari pentru valoarea ping timeout \u00een clientul t\u0103u (de exemplu, 320 de secunde) va rezulta adesea \u00eentr-o conexiune mai robust\u0103 la re\u021bea. \u00cen HexChat po\u021bi configura valoarea tast\u00e2nd <code>/set net_ping_timeout 320</code>. Aceasta va scrie valoarea \u00een fi\u0219ierul <code>hexchat.conf</code>.";
