    t[4624] = "<b>Note:</b> On some Apache installations, the <a href=https://httpd.apache.org/docs/2.4/mod/mod_status.html target=_blank class='sitelink external'>mod_status</a> and <a href=https://httpd.apache.org/docs/2.4/mod/mod_info.html target=_blank class='sitelink external'>mod_info</a> modules are enabled by default. It is important to disable these, or otherwise protect access to the urls, to avoid compromising the anonymity and security of your server.";
    t[4625] = "<b>Not\u0103:</b> La unele instal\u0103ri Apache, modulele <a href=https://httpd.apache.org/docs/2.4/mod/mod_status.html target=_blank class='sitelink external'>mod_status</a> \u0219i  <a href=https://httpd.apache.org/docs/2.4/mod/mod_info.html target=_blank class='sitelink external'>mod_info</a> sunt activate \u00een mod implicit. Este important s\u0103 dezactiva\u021bi aceste module sau s\u0103 proteja\u021bi accesul la URL-uri pentru a evita compromiterea anonimatului \u0219i securit\u0103\u021bii serverului dvs.";
