    t[4702] = "NTCP (NIO-based TCP) and NTCP2 are TCP-based network transports which use Java's NIO (New I/O) TCP implementation to deliver I2NP messages between routers on the network. NTCP2 improves the resistance of NTCP to various attacks and automated traffic identification methods. For more information, see the <a href=https://geti2p.net/en/docs/transport/ntcp class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[4703] = "NTCP (TCP bazat pe NIO) \u0219i NTCP2 sunt transporturi de re\u021bea bazate pe TCP, care utilizeaz\u0103 implementarea TCP NIO (New I/O) a limbajului Java pentru a trimite mesaje I2NP \u00eentre routere pe re\u021bea. NTCP2 \u00eembun\u0103t\u0103\u021be\u0219te rezisten\u021ba NTCP la diferite atacuri \u0219i metode de identificare automatizate a traficului. Pentru mai multe informa\u021bii, consulta\u021bi <a href=https://geti2p.net/en/docs/transport/ntcp class='sitelink external' target=_blank rel=noreferrer>documenta\u021bia online</a>.";
    t[4708] = "You can use a recorder to log the destinations of aggressive clients to a specified file, and then use that same file to throttle them. The following snippet defines a filter that initially allows all connection requests, but if any single destination exceeds 180 requests in 60 seconds, it gets throttled down to 30 requests every 60 seconds:";
    t[4709] = "Pute\u021bi utiliza un \u00eenregistr\u0103tor pentru a \u00eenregistra destina\u021biile clien\u021bilor agresivi \u00eentr-un fi\u0219ier specificat, \u0219i apoi utiliza\u021bi acela\u0219i fi\u0219ier pentru a-i regla. Fragmentul urm\u0103tor define\u0219te un filtru care permite ini\u021bial toate solicit\u0103rile de conectare, dar dac\u0103 o singur\u0103 destina\u021bie dep\u0103\u0219e\u0219te 180 de solicit\u0103ri \u00een 60 de secunde, este reglat\u0103 la 30 de solicit\u0103ri \u00een fiecare 60 de secunde:";
