    t[4930] = "This setting, when configured with a path pointing at a valid blocklist file, enables an additional, user-configured blocklist to be loaded at router startup. [Disabled by default, restart required]";
    t[4931] = "Aceast\u0103 setare, c\u00e2nd este configurat\u0103 cu o cale care arat\u0103 c\u0103tre un fi\u0219ier de list\u0103 de blocare valid, permite \u00eenc\u0103rcarea unei liste suplimentare de blocare, configurat\u0103 de utilizator, la pornirea routerului. [Dezactivat\u0103 \u00een mod implicit, necesit\u0103 repornire]";
    t[4932] = "I2P+ supports custom theme overrides for the console, the tunnel manager, I2PSnark, SusiDNS and Susimail, permitting changes to the themes which are persistent after upgrades. In order to activate an override, create a css file named <code>override.css</code> with your theme modifications and place it in the relevant theme directory of the theme you wish to change, or rename one of the example files, and then hard refresh the browser. Note that the tunnel manager and the console share the same override.css. To deactivate an override, delete or rename the <code>override.css</code> file and then hard refresh the browser (usually Control + Shift + R).";
    t[4933] = "I2P+ suport\u0103 suprascrieri de teme personalizate pentru consol\u0103, managerul de tunele, I2PSnark, SusiDNS \u0219i Susimail, permit\u00e2nd modific\u0103ri persistente ale temelor dup\u0103 actualiz\u0103ri. Pentru a activa o suprascriere, crea\u021bi un fi\u0219ier css numit <code>override.css</code> cu modific\u0103rile temei \u0219i plasa\u021bi-l \u00een directorul temei corespunz\u0103toare temei pe care dori\u021bi s\u0103 o schimba\u021bi, sau redenumi\u021bi unul dintre fi\u0219ierele exemplu \u0219i apoi actualiza\u021bi for\u021bat browser-ul. Nota\u021bi c\u0103 managerul de tunele \u0219i consola partajeaz\u0103 acela\u0219i override.css. Pentru a dezactiva o suprascriere, \u0219terge\u021bi sau redenumi\u021bi fi\u0219ierul <code>override.css</code> \u0219i apoi actualiza\u021bi for\u021bat browser-ul (de obicei Control + Shift + R).";
