    t[5042] = "When set to true, this setting enables reverse DNS lookups for peers, triggered when displaying the country flag of a peer or when the hostname or domain is explicitly displayed in the console, or when the peer's RouterInfo is written to disk. In order to avoid repeat lookups, it's recommended to configure a generous caching policy for DNS lookups of 10 minutes or more, and to configure a privacy respecting DNS server in your operating system. [Disabled by default, restart required]";
    t[5043] = "Atunci c\u00e2nd este setat pe true, aceast\u0103 setare activeaz\u0103 c\u0103utarea invers\u0103 DNS pentru peerii, declan\u0219at\u0103 la afi\u0219area drapelului \u021b\u0103rii unui peer sau c\u00e2nd numele de gazd\u0103 sau domeniul este afi\u0219at \u00een mod explicit \u00een consol\u0103, sau c\u00e2nd RouterInfo al peer-ului este scris pe disc. Pentru a evita c\u0103ut\u0103rile repetitive, se recomand\u0103 configurarea unei politici generoase de cache pentru c\u0103ut\u0103rile DNS de 10 minute sau mai mult \u0219i configurarea unui server DNS care respect\u0103 confiden\u021bialitatea \u00een sistemul de operare. [Dezactivat din oficiu, este necesar repornirea]";
