    t[5084] = "If you're running a dynamic site handling a large number of concurrent users, content caching can often improve the time taken to deliver pages. For content that rapidly changes, a <a href=https://blog.stackpath.com/glossary-micro-caching/ target=_blank class='sitelink external'>micro-caching strategy</a> may still yield some benefits. The <a href=https://www.nginx.com/ target=_blank class='sitelink external'>Nginx webserver</a> provides a competent caching sub-system, or for a more heavy-weight solution, have a look at <a href=https://varnish-cache.org/ target=_blank class='sitelink external'>Varnish</a>.";
    t[5085] = "Dac\u0103 rula\u021bi un site dinamic care manipuleaz\u0103 un num\u0103r mare de utilizatori simultan, cache-ul de con\u021binut poate \u00eembun\u0103t\u0103\u021bi adesea timpul necesar pentru a livra paginile. Pentru con\u021binutul care se modific\u0103 rapid, o <a href=https://blog.stackpath.com/glossary-micro-caching/ target=_blank class='sitelink external'>strategie de micro-cache</a> poate ob\u021bine \u00een continuare beneficii. Serverul web <a href=https://www.nginx.com/ target=_blank class='sitelink external'>Nginx</a> ofer\u0103 un sub-sistem competen de cache, sau pentru o solu\u021bie mai grea, arunca\u021bi o privire la <a href=https://varnish-cache.org/ target=_blank class='sitelink external'>Varnish</a>.";
