    t[5330] = "The default subscription is to <code>http://i2p-projekt.i2p/hosts.txt</code> which is seldom updated. If you don't have another subscription, you may often have to use \"jump\" links which is much slower but ensures that your addressbook is only populated by sites you use (in addition to the default subscription addresses). To speed up browsing on I2P, it's a good idea to add some addressbook subscriptions.";
    t[5331] = "Abonamentul implicit este pentru <code>http://i2p-projekt.i2p/hosts.txt</code> care este actualizat rareori. Dac\u0103 nu ave\u021bi alt abonament, este posibil s\u0103 trebuiasc\u0103 s\u0103 utiliza\u021bi adesea link-uri \"jump\" care sunt mult mai lente, dar asigur\u0103 c\u0103 agenda dvs. de adrese este populat\u0103 doar de site-uri pe care le utiliza\u021bi (\u00een plus fa\u021b\u0103 de adresele din abonamentul implicit). Pentru a accelera navigarea pe I2P, este o idee bun\u0103 s\u0103 ad\u0103uga\u021bi c\u00e2teva abonamente la agenda de adrese.";
