    t[5514] = "If after a few minutes of uptime your router is indicating 0 Active Peers and 0 Known Peers, with a notification in the sidebar that you need to check your network connection, verify that you can access the internet. If your internet connection is functional, you may need to unblock Java in your firewall. Otherwise, you may need to reseed your I2P router. Visit the <a href=/configreseed#reseedconfig>Reseed Configuration page</a> and click the <i>Save Changes and Reseed Now</i> button. For more information, see the <a href=#reseedhelp>Reseed help section</a> above.";
    t[5515] = "Dac\u0103 dup\u0103 c\u00e2teva minute de la pornirea routerului indic\u0103 0 peeri activi \u0219i 0 peeri cunoscu\u021bi, cu o notificare \u00een bara lateral\u0103 c\u0103 trebuie s\u0103 verifica\u021bi conexiunea la re\u021bea, verifica\u021bi dac\u0103 pute\u021bi accesa internetul. Dac\u0103 conexiunea la internet este func\u021bional\u0103, este posibil s\u0103 fie necesar s\u0103 debloca\u021bi Java \u00een firewall-ul dvs. \u00cen caz contrar, este posibil s\u0103 fie necesar s\u0103 recurge\u021bi la re\u00eenc\u0103rcarea routerului I2P. Accesa\u021bi pagina de <a href=/configreseed#reseedconfig>Configurare Re\u00eenc\u0103rcare</a> \u0219i face\u021bi clic pe butonul <i>Salveaz\u0103 modific\u0103rile \u0219i re\u00eencarc\u0103 acum</i>. Pentru mai multe informa\u021bii, consulta\u021bi sec\u021biunea de ajutor <a href=#reseedhelp>Re\u00eenc\u0103rcare</a> de mai sus.";
    t[5518] = "A higher level socket API for clients. Only opened when a SAM V3 client requests a UDP session. Can be enabled/disabled on the <a href=/configclients> Client Configuration page</a>. Can be changed in the <code>clients.config</code> file with the SAM command line option <code>sam.udp.port=nnnn</code>.";
    t[5519] = "O interfa\u021b\u0103 superioar\u0103 de tip socket API pentru clien\u021bi. Se deschide doar atunci c\u00e2nd un client SAM V3 solicit\u0103 o sesiune UDP. Poate fi activat/dezactivat pe <a href=/configclients>pagina de configurare a clientului</a>. Poate fi modificat \u00een fi\u0219ierul <code>clients.config</code> folosind op\u021biunea liniei de comand\u0103 SAM <code>sam.udp.port=nnnn</code>.";
    t[5526] = "If you want your site to feel responsive, image compression is essential when hosting large images. Using a service like <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> to compress your png and jpeg images will often result in much smaller files with minimal loss of quality. In some situations the webp format can best jpegs, generating smaller files with approximately the same or better visual fidelity, and has wide browser support. Also consider using svgs instead of bitmaps for icons and illustrations - they're often smaller than the equivalent bitmap file (run them through a service like <a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a> to remove unneeded cruft), scale without loss of quality, and can be gzipped by your webserver.";
    t[5527] = "Dac\u0103 dori\u021bi ca site-ul dvs. s\u0103 fie reactiv, compresia imaginilor este esen\u021bial\u0103 atunci c\u00e2nd g\u0103zdui\u021bi imagini mari. Utilizarea unui serviciu precum <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> pentru a comprima imaginile png \u0219i jpeg va duce adesea la fi\u0219iere mult mai mici cu pierderi minime de calitate. \u00cen unele situa\u021bii, formatul webp poate fi mai eficient dec\u00e2t jpeg, gener\u00e2nd fi\u0219iere mai mici cu aproximativ aceea\u0219i sau o calitate vizual\u0103 mai bun\u0103, \u0219i are o suport\u0103 larg\u0103 \u00een browers. Lua\u021bi \u00een considerare \u0219i utilizarea fi\u0219ierelor SVG \u00een locul fi\u0219ierelor bitmap pentru pictograme \u0219i ilustra\u021bii - adesea fi\u0219ierele SVG sunt mai mici dec\u00e2t echivalentul \u00een fi\u0219iere bitmap (rula\u021bi-le printr-un serviciu precum <a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a> pentru a elimina componentele nefolositoare), au scalabilitate f\u0103r\u0103 pierdere de calitate, \u0219i pot fi gzippate de serverul dvs. web.";
    t[5528] = "UPnP disabled on the device";
    t[5529] = "UPnP este dezactivat pe dispozitiv";
    t[5536] = "By default, most of your client services (mail, http proxy, IRC) will share the same set of tunnels (for performance reasons) and be listed as <i>Shared Clients</i> and <i>Shared Clients(DSA)</i> in the sidebar under Service Tunnels and on the <a href=/tunnels>Tunnels page</a>.";
    t[5537] = "\u00cen mod implicit, majoritatea serviciilor client (po\u0219t\u0103, proxy http, IRC) vor folosi acela\u0219i set de tuneluri (din motive de performan\u021b\u0103) \u0219i vor fi listate \u00een sec\u021biunea de sub Tuneluri de serviciu din bara lateral\u0103 dreapta, cu denumirea <i>Clien\u021bi partaja\u021bi</i> \u0219i <i>Clienti partajati(DSA)</i>, iar pe pagina <a href=/tunnels>tuneluri</a>.";
