    t[5544] = "This section is not enabled by default unless <a href='/help/configuration#advancedconsole'>Advanced Console mode</a> is enabled. You may enable it on the <a href='/configsidebar'>Sidebar Configuration page</a>.";
    t[5545] = "Aceast\u0103 sec\u021biune nu este activat\u0103 \u00een mod implicit dec\u00e2t dac\u0103 este activat <a href='/help/configuration#advancedconsole'>Modul Avansat Consol\u0103</a>. Pute\u021bi activa sec\u021biunea pe pagina de <a href='/configsidebar'>Configurare a Barei Laterale</a>.";
