    t[5554] = "Firewalls, Modems &amp; Routers";
    t[5555] = "Firewall-uri, Modeme &amp; Routere";
    t[5556] = "Also, some routers cannot correctly forward both TCP and UDP on a single port, or may have other limitations or bugs that prevent them from passing traffic through to I2P.";
    t[5557] = "De asemenea, unele routere nu pot \u00eenainta \u00een mod corect at\u00e2t TCP c\u00e2t \u0219i UDP pe un singur port, sau pot avea alte limit\u0103ri sau bug-uri care le \u00eempiedic\u0103 la trecerea traficului prin I2P.";
