    t[5612] = "A <a href=https://geti2p.net/en/docs/tunnels/unidirectional class='sitelink external' target=_blank rel=noreferrer>unidirectional</a> encrypted communication pathway between a client or server on the I2P network. Similar to a circuit in Tor, except that Tor circuits are bidirectional.";
    t[5613] = "O cale de comunica\u021bie criptat\u0103 <a href=https://geti2p.net/en/docs/tunnels/unidirectional class='sitelink external' target=_blank rel=noreferrer>unidirec\u021bional\u0103</a> \u00eentre un client sau un server pe re\u021beaua I2P. Asem\u0103n\u0103tor unui circuit \u00een Tor, cu excep\u021bia faptului c\u0103 circuitele Tor sunt bidirec\u021bionale.";
