    t[5684] = "Check to see if another program is using the configured port. If so, stop that program or configure I2P to use a different port.";
    t[5685] = "Verifica\u021bi dac\u0103 un alt program nu foloseste portul configurat. Dac\u0103 este a\u0219a, opri\u021bi acel program sau configura\u021bi I2P s\u0103 utilizeze alt port.";
    t[5692] = "Manually edit peers and view banned peers and blocklist";
    t[5693] = "Edita\u021bi manual colegii \u0219i vizualiza\u021bi colegii interzi\u0219i \u0219i lista blocat\u0103";
    t[5712] = "Firewalled with Inbound TCP Enabled";
    t[5713] = "Firewall cu TCP de intrare activat";
    t[5716] = "Open <a href=/confignet#udpconfig>I2P+'s port</a> on your modem, router and/or firewall(s) for better connectivity (ideally both UDP and TCP). More information on how to go about port forwarding can be found at <a href=http://portforward.com/ target=_blank rel=noreferrer class='sitelink external'>portforward.com</a>, in addition to our forums and IRC channels listed below. Note that I2P does not support connecting to the internet via an http or socks proxy [patches welcome!], though you can connect to proxies via I2P itself once connected to the network.";
    t[5717] = "Deschide\u021bi <a href=/confignet#udpconfig>portul I2P+</a> pe modemul, routerul \u0219i/sau firewall-urile dvs. pentru a avea o conectivitate mai bun\u0103 (ideal at\u00e2t UDP, c\u00e2t \u0219i TCP). Mai multe informa\u021bii despre redirec\u021bionarea porturilor pot fi g\u0103site la adresa <a href=http://portforward.com/ target=_blank rel=noreferrer class='sitelink external'>portforward.com</a>, \u00een plus fa\u021b\u0103 de forumurile \u0219i canalele noastre IRC enumerate mai jos. Nota\u021bi c\u0103 I2P nu permite conectarea la internet printr-un proxy http sau socks [sunte\u021bi binevenit s\u0103 contribui\u021bi cu patch-uri!], cu toate acestea, pute\u021bi conecta la proxy-uri prin I2P \u00eensu\u0219i dup\u0103 conectarea la re\u021bea.";
    t[5730] = "A tunnel filter can provide protection against denial of service attacks, without otherwise interrupting the service for genuine users, either in conjunction with the tunnel throttler or as an alternative strategy. It can also be used to log access to a hosted service to determine if the server is under attack, or simply to log all visitors by I2P destination. Additionally, a filter can function simultaneously as a whitelist and blacklist making it more flexible than the Tunnel Manager's access list controls. Note that multiple server tunnels can share a single filter file if you wish to implement a global filter.";
    t[5731] = "Un filtru de tunel poate furniza protec\u021bie \u00eempotriva atacurilor de tipul denial of service, f\u0103r\u0103 \u00eentreruperea serviciului pentru utilizatorii legitimi, fie \u00een conjunc\u021bie cu func\u021bia de reglare a ratei tunelului, fie ca o strategie alternativ\u0103. De asemenea, poate fi utilizat pentru a \u00eenregistra accesul la un serviciu g\u0103zduit pentru a determina dac\u0103 serverul este atacat sau doar pentru a \u00eenregistra to\u021bi vizitatorii \u00een func\u021bie de destina\u021bie I2P. \u00cen plus, un filtru poate func\u021biona simultan ca o list\u0103 de permitere \u0219i o list\u0103 de interzicere, ceea ce \u00eel face mai flexibil dec\u00e2t controalele listei de acces ale Gestorului Tunelului. Aten\u021bie c\u0103 mai multe tuneluri de server pot partaja un singur fi\u0219ier de filtru dac\u0103 dori\u021bi s\u0103 implementa\u021bi un filtru global.";
