    t[6026] = "This setting (in milliseconds) allows you to manually configure the delay between router refresh updates run by the Refresh Routers Job. By default the pause between refreshes is determined by the size of the NetDb, and introduces some randomness in the timing to mitigate traffic analysis. For values lower than 2000 milliseconds, increasing the value of <code>router.refreshTimeout</code> is recommended. Note that setting this value below 2000 milliseconds will increase your network traffic and may introduce job lag, and is not recommended for sustained use.";
    t[6027] = "Aceast\u0103 setare (\u00een milisecunde) v\u0103 permite s\u0103 configura\u021bi manual intervalul dintre actualiz\u0103rile de re\u00eemprosp\u0103tare a rutereului executate de jobul Refresh Routers. \u00cen mod implicit, pauza dintre re\u00eemprosp\u0103t\u0103ri este determinat\u0103 de dimensiunea NetDb \u0219i introduce o anumit\u0103 aleatorietate \u00een programare pentru a atenua analiza traficului. Pentru valori mai mici de 2000 milisecunde, se recomand\u0103 cre\u0219terea valorii <code>router.refreshTimeout</code>. Re\u021bine\u021bi c\u0103 setarea acestei valori sub 2000 milisecunde va cre\u0219te traficul re\u021belei \u0219i poate introduce \u00eent\u00e2rzieri \u00een job, fiind, prin urmare, nerecomandat\u0103 pentru o utilizare sus\u021binut\u0103.";
    t[6030] = "Server tunnels, configurable in the <a href=/i2ptunnelmgr>Tunnel Manager</a>, provide a number of ways to limit access to the hosted service. Destination whitelisting, blacklisting, connection throttling, and tunnel filtering are methods provisioned to mitigate denial of service attacks, grant exclusive access to known I2P destinations, and manage traffic to the server.";
    t[6031] = "Tunelurile serverului, configurabile \u00een <a href=/i2ptunnelmgr>Gestorul Tunel</a>, ofer\u0103 o serie de modalit\u0103\u021bi de limitare a accesului la serviciul g\u0103zduit. Listarea \u00een liste albe, liste negre, reducerea vitezei de conexiune \u0219i filtrarea tunelului sunt metode prev\u0103zute pentru a combate atacurile de tip denial of service, pentru a acorda acces exclusiv la destina\u021biile I2P cunoscute \u0219i pentru a gestiona traficul c\u0103tre server.";
