    t[6214] = "Do not reveal this file to unknown users, as it contains sensitive data (100 RouterInfo files) from your own I2P router which potentially could be used by an adversary to decloak your identity. In order to protect your anonymity: you should wait for a few hours/days before sharing the file with your trusted friend. It is also advisable to use this procedure sparingly (no more than once a week).";
    t[6215] = "Nu dezv\u0103lui\u021bi acest fi\u0219ier utilizatorilor necunoscu\u021bi, deoarece con\u021bine date sensibile (100 de fi\u0219iere RouterInfo) de la propria dumneavoastr\u0103 rut\u0103 I2P care ar putea fi folosite de c\u0103tre un adversar pentru a dezv\u0103lui identitatea dumneavoastr\u0103. Pentru a v\u0103 proteja anonimatul: ar trebui s\u0103 a\u0219tepta\u021bi c\u00e2teva ore/zile \u00eenainte de a \u00eemp\u0103rt\u0103\u0219i fi\u0219ierul cu un prieten de \u00eencredere. De asemenea, este recomandat s\u0103 utiliza\u021bi aceast\u0103 procedur\u0103 cu precau\u021bie (nu mai mult de o dat\u0103 pe s\u0103pt\u0103m\u00e2n\u0103).";
