    t[6244] = "The act of contributing to the network by permitting other routers to build tunnels using your router in a tunnel chain. At least 12KB/s upstream bandwidth (network share) is required to be allocated in order to enable participation. Note that firewalled routers will be limited in how much they contribute to participation, and a router designated as Hidden will not participate at all.";
    t[6245] = "Actul de a contribui la re\u021bea prin permiterea altor rutere s\u0103 construiasc\u0103 tuneluri folosind ruterul t\u0103u \u00eentr-o lan\u021b de tuneluri. Pentru a permite participarea, este necesar\u0103 alocarea unei l\u0103\u021bimi de band\u0103 \u00een aval (partajare de re\u021bea) de cel pu\u021bin 12KB/s. Re\u021bine\u021bi c\u0103 ruterelor cu firewall limitat li se va limita contribu\u021bia la participare, iar un ruter desemnat ca Ascuns nu va participa deloc.";
