    t[6350] = "This setting determines the number of peers to explore in parallel when the Peer Exploration Job runs [default is 1 peer at a time when more than 3000 peers are known]. Note that increasing this value will increase the bandwidth requirements for the exploration, and setting this value too high may cause excessive message delay and interfere with other services, so use with caution!";
    t[6351] = "Aceast\u0103 setare determin\u0103 num\u0103rul de peer-uri de explorat \u00een paralel atunci c\u00e2nd ruleaz\u0103 Job pentru explorarea peer-ului [valoarea implicit\u0103 este de 1 peer la nivel de timp c\u00e2nd sunt cunoscu\u021bi mai mult de 3000 de peer-i]. Re\u021bine\u021bi c\u0103 m\u0103rirea acestei valori va cre\u0219te cerin\u021bele de band\u0103 pentru explorare \u0219i setarea acestei valori prea mari poate provoca o \u00eent\u00e2rziere excesiv\u0103 a mesajelor \u0219i poate interfera cu alte servicii, a\u0219a c\u0103 utiliza\u021bi cu aten\u021bie!";
