    t[6382] = "Note: To enhance your security when browsing .i2p sites, you may wish to consider installing an addon to prevent Javascript from running in the browser such as <a href=https://addons.mozilla.org/en-US/firefox/addon/noscript/ target=_blank rel=noreferrer class='sitelink external'>NoScript</a>, though it's recommended to whitelist the address I2P+ is running on to enable various router console enhancements. In addition, an addon that prevents requests to offsite resources is also recommended, for example <a href=https://addons.mozilla.org/en-US/firefox/addon/umatrix/ target=_blank rel=noreferrer class='sitelink external'>uMatrix</a>.";
    t[6383] = "Not\u0103: Pentru a v\u0103 \u00eembun\u0103t\u0103\u021bi securitatea atunci c\u00e2nd naviga\u021bi pe site-urile .i2p, pute\u021bi lua \u00een considerare instalarea unui add-on pentru a \u00eempiedica rularea Javascript-ului \u00een browser, cum ar fi <a href=https://addons.mozilla.org/en-US/firefox/addon/noscript/ target=_blank rel=noreferrer class='sitelink external'>NoScript</a>, de\u0219i se recomand\u0103 s\u0103 ad\u0103uga\u021bi adresa pe care ruleaz\u0103 I2P+ la whitelist pentru a activa diverse \u00eembun\u0103t\u0103\u021biri ale consolei routerului. \u00cen plus, se recomand\u0103 \u0219i un add-on care s\u0103 previn\u0103 solicit\u0103rile c\u0103tre resurse externa, de exemplu <a href=https://addons.mozilla.org/en-US/firefox/addon/umatrix/ target=_blank rel=noreferrer class='sitelink external'>uMatrix</a>.";
