    t[6762] = "I2P+ may be slow to integrate into network the first time you run it as it bootstraps into the network and learns of additional peers. The longer your I2P+ router is running, the better it will perform, so try and keep your router on as long as you can, 24/7 if possible! If, after 30 minutes, your <i>Active: [connected/recent]</i> count still has less than 10 peers, or your total number of <i>Integrated</i> peers is less than 5, there are several things you can do to check for problems:";
    t[6763] = "I2P+ poate fi lent s\u0103 se integreze \u00een re\u021bea prima dat\u0103 c\u00e2nd \u00eel rula\u021bi, deoarece se configureaz\u0103 \u00een re\u021bea \u0219i afl\u0103 de peere suplimentare. Cu c\u00e2t ruleaz\u0103 mai mult routerul I2P+, cu at\u00e2t va func\u021biona mai bine, a\u0219a c\u0103 \u00eencerca\u021bi s\u0103 v\u0103 \u021bine\u021bi routerul pornit c\u00e2t mai mult posibil, 24/7 dac\u0103 este posibil! Dac\u0103, dup\u0103 30 de minute, num\u0103rul dvs. de colegi <i>Activi: [conecta\u021bi/recent]</i> are \u00eenc\u0103 mai pu\u021bin de 10 peere sau num\u0103rul total de colegi <i>Integra\u021bi</i> este mai mic de 5, sunt c\u00e2teva lucruri pe care le pute\u021bi face pentru a verifica problemele:";
