    t[6943] = "De mare capacitate";
    t[6944] = "A java implementation of a Tor client, available as an I2P plugin. Can be used as the default <i>outproxy</i> if configured in the relevant SOCKS or HTTP client tunnel in the <i>Tunnel Manager</i>. Available from <a href=http://stats.i2p/i2p/plugins class=sitelink>http://stats.i2p/i2p/plugins</a>. Source code is available on <a href=https://github.com/i2p/i2p.plugins.orchid class='sitelink external' target=_blank rel=noreferrer>github</a>.";
    t[6945] = "O implementare \u00een Java a unui client Tor, disponibil ca plugin I2P. Poate fi utilizat ca <i>outproxy</i> implicit dac\u0103 este configurat \u00een tunelul client SOCKS sau HTTP relevant din <i>Managerul de Tunnels</i>. Disponibil de la adresa <a href=http://stats.i2p/i2p/plugins class=sitelink>http://stats.i2p/i2p/plugins</a>. Codul surs\u0103 este disponibil pe <a href=https://github.com/i2p/i2p.plugins.orchid class='sitelink external' target=_blank rel=noreferrer>github</a>.";
    t[6952] = "IPv4 Addresses";
    t[6953] = "Adrese IPv4";
    t[6956] = "This section indicates your average bandwidth speeds and total usage for the session. All values are in bytes per second. You may change your bandwidth limits on the <a href='/config'>Bandwidth Configuration page</a>. The more bandwidth you make available, the more you help the network and improve your own anonymity, so please take the time to review the settings. If you are unsure of your network's speed, using a service such as <a href='http://speedtest.net/'>SpeedTest</a> or similar will give you a good indication of your bandwidth capability. Your upstream share amount (KBps Out) will determine your overall contribution to the network. Bandwidth is <a href='/graphs'>graphed</a> by default.";
    t[6957] = "Aceast\u0103 sec\u021biune indic\u0103 vitezele medii de band\u0103 \u0219i utilizarea total\u0103 pentru sesiune. Toate valorile sunt exprimate \u00een octe\u021bi pe secund\u0103. Pute\u021bi schimba limitele dvs. de l\u0103\u021bime de band\u0103 pe <a href='/config'>pagina Configurare L\u0103\u021bime de band\u0103</a>. Cu c\u00e2t furniza\u021bi mai mult\u0103 l\u0103\u021bime de band\u0103, cu at\u00e2t ajuta\u021bi re\u021beaua \u0219i \u00eembun\u0103t\u0103\u021bi\u021bi anonimatul propriu, a\u0219a c\u0103 v\u0103 rug\u0103m s\u0103 v\u0103 lua\u021bi timp s\u0103 verifica\u021bi set\u0103rile. Dac\u0103 nu sunte\u021bi sigur de viteza re\u021belei dvs., utilizarea unui serviciu precum <a href='http://speedtest.net/'>SpeedTest</a> sau asem\u0103n\u0103tor v\u0103 va da o indicatie bun\u0103 despre capacitatea dvs. de l\u0103\u021bime de band\u0103. Cantitatea dvs. de partajare upstream (KBps Out) va determina contribu\u021bia general\u0103 la re\u021bea. L\u0103\u021bimea de band\u0103 este reprezentat\u0103 <a href='/graphs'>grafic\u0103</a> implicit.";
