    t[7005] = "Aceast\u0103 setare v\u0103 permite s\u0103 configura\u021bi num\u0103rul minim de tuneluri participante g\u0103zduite \u00eenainte ca routerul s\u0103 \u00eenceap\u0103 s\u0103 resping\u0103 cererile de tuneluri pe baza necesit\u0103\u021bilor anticipate de l\u0103\u021bime de band\u0103. [Valoarea implicit\u0103 este 100 dac\u0103 sistemul ruleaz\u0103 Android, 800 dac\u0103 sistemul ruleaz\u0103 pe platform\u0103 ARM \u0219i are mai pu\u021bin de 4 nuclee disponibile, 1200 dac\u0103 sistemul ruleaz\u0103 pe platform\u0103 ARM \u0219i are 4 sau mai multe nuclee disponibile, \u00een caz contrar 2500]";
    t[7012] = "Delete key";
