    t[7022] = "This setting (in milliseconds) allows you to manually configure the queue delay target value for the CoDel queue management system. Default is 50ms. [Restart required]";
    t[7023] = "Aceast\u0103 setare (\u00een milisecunde) v\u0103 permite s\u0103 configura\u021bi manual valoarea \u021bint\u0103 a \u00eent\u00e2rzierii cozii pentru sistemul de gestionare a cozii CoDel. Valoarea implicit\u0103 este de 50 ms. [Este necesar repornirea]";
    t[7030] = "In order to maintain anonymity, it is recommended to update using the I2P http proxy. If the news or I2P update is hosted on I2P, using the proxy will be necessary.";
    t[7031] = "Pentru a men\u021bine anonimatul, este recomandat s\u0103 se actualizeze folosind proxy -ul I2P HTTP. Dac\u0103 va fi necesar\u0103 actualizarea \u0219tirilor sau a I2P pe I2P, utilizarea proxy va fi necesar\u0103.";
    t[7054] = "A threshold to apply to remote destinations listed in a file";
    t[7055] = "Un prag de aplicat destina\u021biilor de la distan\u021b\u0103 enumerate \u00eentr-un fi\u0219ier";
    t[7062] = "The su3 format is preferred, as it will be verified as signed by a trusted source.";
