    t[7158] = "I2P does not work well behind this type of firewall. You will probably not be able to accept inbound connections, which will limit your participation in the network.";
    t[7159] = "I2P nu func\u021bioneaz\u0103 bine \u00een spatele acestui tip de firewall. Este posibil s\u0103 nu pute\u021bi accepta conexiuni de intrare, ceea ce v\u0103 va limita participarea \u00een re\u021bea.";
    t[7166] = "The I2P Client Protocol (I2CP) enables external applications (clients) to communicate with I2P over single TCP socket, by default using port 7654. For more information, see the <a href=https://geti2p.net/en/docs/protocol/i2cp class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7167] = "Protocolul client I2P (I2CP) permite aplica\u021biilor externe (cli\u0219ti) s\u0103 comunice cu I2P prin intermediul unui singur socket TCP, folosind \u00een mod implicit portul 7654. Pentru mai multe informa\u021bii, consulta\u021bi <a href=https://geti2p.net/en/docs/protocol/i2cp class='sitelink external' target=_blank rel=noreferrer>documenta\u021bia online</a>.";
    t[7168] = "Queue Totals";
    t[7169] = "Totaluri \u00een coad\u0103";
    t[7170] = "This setting determines which transport takes priority when communicating with peers. By default, NTCP is favored over UDP (SSU). By setting the value to true, UDP will be favored unless a pre-existing NTCP connection exists; when set to always, UDP will always be used regardless of any pre-existing NTCP connection. [Default is false]";
    t[7171] = "Aceast\u0103 setare determin\u0103 care transport are prioritate \u00een comunicarea cu colegii de re\u021bea. \u00cen mod implicit, NTCP este preferat \u00een defavoarea UDP (SSU). Set\u00e2nd valoarea pe true, UDP va fi preferat astfel dac\u0103 exist\u0103 deja o conexiune NTCP preexistent\u0103; c\u00e2nd este setat \u00eentotdeauna, UDP va fi utilizat \u00eentotdeauna indiferent dac\u0103 exist\u0103 o conexiune NTCP preexistent\u0103. [Implicit este false]";
