    t[7292] = "When set to true, I2P runs without network connectivity, which is helpful if you are constantly restarting the router to test code updates as this prevents network disruption.";
    t[7293] = "C\u00e2nd este setat pe true, I2P ruleaz\u0103 f\u0103r\u0103 conectivitate la re\u021bea, ceea ce este util dac\u0103 reporni\u021bi constant router-ul pentru a testa actualiz\u0103ri de cod, deoarece acest lucru previne \u00eentreruperea re\u021belei.";
    t[7302] = "Updating IP address";
