    t[7308] = "SSU [IPv6 Only] with Introducers";
    t[7309] = "IPv6 doar SSU, introducere";
    t[7312] = "SSU (Secure Semi-reliable UDP) is an I2P network transport providing encrypted, connection-oriented, point-to-point connections, in addition to IP address detection and NAT traversal services. For more information, see the <a href=https://geti2p.net/en/docs/transport/ssu class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7313] = "SSU (Secure Semi-reliable UDP) este o re\u021bea de transport I2P care ofer\u0103 conexiuni criptate, orientate spre conexiune, punct-la-punct, \u00een plus fa\u021b\u0103 de detec\u021bia adreselor IP \u0219i serviciile de traversare NAT. Pentru mai multe informa\u021bii, consulta\u021bi <a href=https://geti2p.net/en/docs/transport/ssu class='sitelink external' target=_blank rel=noreferrer>documenta\u021bia online</a>.";
    t[7314] = "Congestion window";
    t[7315] = "Fereastra de congestionare";
    t[7326] = "Use Proxy to Reseed";
    t[7327] = "Folosi\u021bi proxy pentru a re\u00eens\u0103m\u00e2n\u021ba";
    t[7328] = "Until the advent of I2P integration in <a href=http://www.vuze.com/ target=_blank rel=noreferrer class='sitelink external'>Vuze</a>, it wasn't possible to download torrents that weren't hosted on the I2P network. However, now that Vuze (and latterly <a href=https://www.biglybt.com/ target=_blank rel=noreferrer class='sitelink external'>Bigly</a>) allow users to share non-I2P torrents on I2P, non-I2P torrents can be downloaded over I2P if Vuze/Bigly users have chosen to make content available to the I2P network. Popular torrents with a large number of peers are more likely to be accessible via I2P; to determine if the content is available, add the torrent link, magnet or infohash to your I2P-enabled BitTorrent client.";
    t[7329] = "P\u00e2n\u0103 la integrarea I2P \u00een <a href=http://www.vuze.com/ target=_blank rel=noreferrer class='sitelink external'>Vuze</a>, nu a fost posibil s\u0103 desc\u0103rca\u021bi torrente care nu erau g\u0103zduite pe re\u021beaua I2P. Cu toate acestea, acum c\u0103 Vuze (\u0219i ulterior <a href=https://www.biglybt.com/ target=_blank rel=noreferrer class='sitelink external'>Bigly</a>) permit utilizatorilor s\u0103 partajeze torrente non-I2P pe I2P, torrentele non-I2P pot fi desc\u0103rcate prin intermediul I2P dac\u0103 utilizatorii Vuze/Bigly au ales s\u0103 pun\u0103 con\u021binutul la dispozi\u021bia re\u021belei I2P. Torentele populare cu un num\u0103r mare de utilizatori sunt mai accesibile prin intermediul I2P; pentru a determina dac\u0103 con\u021binutul este disponibil, ad\u0103uga\u021bi linkul torentului, magnetul sau infohash-ul \u00een clientul dvs. BitTorrent compatibil cu I2P.";
