    t[7428] = "This setting (in hours) determines how old a RouterInfo in the NetDb is (its last known publication date) before it's classified as stale and deleted. [Default is 28 hours unless the router is a Floodfill, in which case the default is 8 hours]";
    t[7429] = "Aceast\u0103 setare (\u00een ore) determin\u0103 c\u00e2t de veche este o RouterInfo din NetDb (ultima dat\u0103 cunoscut\u0103 de publicare) \u00eenainte de a fi clasificat\u0103 ca \u00eenvechit\u0103 \u0219i \u0219tears\u0103. [Valoarea implicit\u0103 este de 28 ore, cu excep\u021bia cazului \u00een care routerul este un Floodfill, \u00een acest caz valoarea implicit\u0103 este de 8 ore]";
