    t[7443] = "Ajutor router \u0219i \u00eentreb\u0103ri frecvente";
    t[7444] = "If a <i>Registration Authentication</i> string is requested, you can find it on the <a href='http://127.0.0.1:7657/i2ptunnel/register?tunnel=3'>Registration Authentication page</a> linked from the <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. Registration authentication ensures only the owner is able to register or otherwise manage the hostname, and is required on stats.i2p and reg.i2p.";
    t[7445] = "Dac\u0103 se solicit\u0103 un \u0219ir de <i>autentificare la \u00eenregistrare</i>, \u00eel pute\u021bi g\u0103si pe <a href='http://127.0.0.1:7657/i2ptunnel/register?tunnel=3'>pagina de autentificare a \u00eenregistr\u0103rii</a> \u00eenregistrat\u0103 de pe <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>pagina de configurare a managerului tunel</a>. Autentificarea la \u00eenregistrare asigur\u0103 faptul c\u0103 doar proprietarul poate \u00eenregistra sau gestiona numele de gazd\u0103 \u0219i este necesar\u0103 pe stats.i2p \u0219i reg.i2p.";
    t[7448] = "News &amp; Updates";
    t[7449] = "Nout\u0103\u021bi &amp; Actualiz\u0103ri ";
    t[7452] = "[Linux/Unix/Solaris] If you can't start the router with <code>i2p/i2prouter start</code> try the <code>runplain.sh</code> script in the same directory. Root privileges are never required to run I2P+. If you need to compile the <a href=http://i2p-projekt.i2p/jbigi.html target=_blank rel=noreferrer>jBigi library</a> (which is necessary in rare cases), consult the documentation, visit the forums, or visit <a href=irc://127.0.0.1:6668/saltR class=chatlink>the I2P+ channel</a> or <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>IRC developer channel</a>.";
    t[7453] = "[Linux/Unix/Solaris] Dac\u0103 nu pute\u021bi porni ruterul cu <code>i2p/i2prouter start</code> \u00eencerca\u021bi scriptul <code>runplain.sh</code> din aceea\u0219i loca\u021bie. Pentru a rula I2P+ nu sunt necesare privilegii de root. Dac\u0103 ave\u021bi nevoie s\u0103 compila\u021bi biblioteca <a href=http://i2p-projekt.i2p/jbigi.html target=_blank rel=noreferrer>jBigi</a> (necesar \u00een cazuri rare), consulta\u021bi documenta\u021bia, vizita\u021bi forumurile sau accesa\u021bi canalul <a href=irc://127.0.0.1:6668/saltR class=chatlink>I2P+</a> sau <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>canalul IRC pentru dezvoltatori</a>.";
    t[7454] = "Top 50 peers by transit tunnel requests";
