    t[7458] = "Information defining the unique identity of a router on the network which includes its IP address (or the IP addresses of intermediate introducers) and listening port, public signing and encryption keys. Router identities correlate to peers in the NetDB. Also referred to as a <i>RouterInfo</i>.";
    t[7459] = "Informa\u021bii care definesc identitatea unic\u0103 a unui router \u00een re\u021bea, care include adresa sa IP (sau adresele IP ale introduc\u0103torilor intermediari) \u0219i portul de ascultare, cheile publice de semnare \u0219i criptare. Identit\u0103\u021bile ruterei se coreleaz\u0103 cu partenerii din NetDB. De asemenea, cunoscute ca <i>RouterInfo</i>.";
