    t[7690] = "A distributed database containing router contact information (RouterInfos) and destination contact information (LeaseSets). A single router maintains its own (partial) database for communicating with other routers on the network; no single router will maintain a list of all routers. The RouterInfos are stored on disk and read into memory when the router starts, or when new RouterInfos are acquired. Also referred to as the <i>NetDb</i>. For more information, see the <a href=https://geti2p.net/en/docs/how/network-database class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7691] = "O baz\u0103 de date distribuit\u0103 care con\u021bine informa\u021bii de contact ale routerelor (RouterInfos) \u0219i informa\u021bii de contact ale destina\u021biei (LeaseSets). Un singur router \u00ee\u0219i men\u021bine propria baz\u0103 de date (par\u021bial\u0103) pentru a comunica cu alte routere din re\u021bea; niciun router nu va men\u021bine o list\u0103 a tuturor routerelor. RouterInfos sunt stocate pe disc \u0219i citite \u00een memorie c\u00e2nd routerul porne\u0219te sau atunci c\u00e2nd se ob\u021bin RouterInfos noi. Mai este denumit \u0219i <i>NetDb</i>. Pentru mai multe informa\u021bii, consulta\u021bi <a href=https://geti2p.net/en/docs/how/network-database class='sitelink external' target=_blank rel=noreferrer>documenta\u021bia online</a>.";
    t[7692] = "Address";
    t[7693] = "Adresa";
    t[7694] = "A threshold is defined by the number of connection attempts a remote destination is permitted to perform over a specified number of seconds before a \"breach\" occurs.";
    t[7695] = "Un prag este definit de num\u0103rul de \u00eencerc\u0103ri de conexiune pe care o destina\u021bie de la distan\u021b\u0103 este permis\u0103 s\u0103 le efectueze \u00eentr-un anumit num\u0103r de secunde \u00eenainte de a avea loc o \u201e\u00eenc\u0103lcare\u201d.";
    t[7704] = "Clearnet normally refers to the publicly accessible internet, the opposite of the darknet that typically describes the encrypted, anonymous services built on I2P, Tor etc. For more information, see the <a href=https://en.wikipedia.org/wiki/Clearnet_(networking) class='sitelink external' target=_blank rel=noreferrer>Wikipedia article</a>.";
    t[7705] = "Clearnet se refer\u0103 de obicei la internetul accesibil publicului, opusul darknet-ului care descrie \u00een mod obi\u0219nuit serviciile criptate, anonime construite pe I2P, Tor etc. Pentru mai multe informa\u021bii, consulta\u021bi <a href=https://en.wikipedia.org/wiki/Clearnet_(networking) class='sitelink external' target=_blank rel=noreferrer>articolul Wikipedia</a>.";
