    t[7818] = "Defines the maximum number of parallel <a href=/jobs>jobs</a> that can be run. The default value is determined by the amount of memory allocated to the JVM via <code>wrapper.config</code>, and is set at 3 for less than 64MB, 4 for less than 256M, or 5 for more than 256MB. Note: A change to this setting requires a restart of the router.";
    t[7819] = "Define\u0219te num\u0103rul maxim de <a href=/jobs>task-uri</a> paralele care pot fi executate. Valoarea implicit\u0103 este determinat\u0103 de cantitatea de memorie alocat\u0103 JVM-ului prin intermediul <code>wrapper.config</code> \u0219i este setat\u0103 la 3 pentru mai pu\u021bin de 64MB, 4 pentru mai pu\u021bin de 256M sau 5 pentru mai mult de 256MB. Not\u0103: O modificare a acestei set\u0103ri necesit\u0103 repornirea routerului.";
