    t[7990] = "A router on the network tasked with providing and receiving information about other routers and services on the network. The current minimum share bandwidth for a router to be considered as capable of performing floodfill duties is 128 KBytes/sec, though it's possible to override this requirement and force a router to be a floodfill on the <a href=/configadvanced>Advanced Configuration page</a>. For more information, see the <a href=https://geti2p.net/en/docs/how/network-database#floodfill class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7991] = "Un ruter din re\u021beaua responsabil pentru furnizarea \u0219i primirea de informa\u021bii despre alte rutere \u0219i servicii din re\u021bea. L\u0103\u021bimea de band\u0103 minim\u0103 partajat\u0103 actual\u0103 pentru ca un ruter s\u0103 fie considerat capabil s\u0103 \u00eendeplineasc\u0103 sarcinile floodfill este de 128 KBytes/sec, de\u0219i este posibil s\u0103 se suprascrie aceast\u0103 cerin\u021b\u0103 \u0219i s\u0103 se for\u021beze un ruter s\u0103 fie un floodfill pe pagina de <a href=/configadvanced>Configurare Avansat\u0103</a>. Pentru mai multe informa\u021bii, consulta\u021bi <a href=https://geti2p.net/en/docs/how/network-database#floodfill class='sitelink external' target=_blank rel=noreferrer>documenta\u021bia online</a>.";
