    t[8208] = "Wherever possible, assets that are used repeatedly on your site should be loaded from an external file and not inlined. If you're using the same CSS on several pages, create a separate css file and load that in the <code>&lt;head&gt;</code> section of your pages. This will make styling updates to your site easier to manage, and will also allow the file to be cached in the visitor's browser, resulting in less bandwidth demands on your webserver and faster page loads for your visitors.";
    t[8209] = "\u00cen m\u0103sura posibilului, resursele care sunt utilizate \u00een repetate r\u00e2nduri pe site-ul dvs. ar trebui \u00eenc\u0103rcate dintr-un fi\u0219ier extern \u0219i nu \u00eenlineat. Dac\u0103 utiliza\u021bi acela\u0219i CSS pe mai multe pagini, crea\u021bi un fi\u0219ier CSS separat \u0219i \u00eenc\u0103rca\u021bi-l \u00een sec\u021biunea <code>&lt;head&gt;</code> a paginilor dvs. Acest lucru va face mai u\u0219or gestionarea actualiz\u0103rilor de stil pe site-ul dvs. \u0219i va permite, de asemenea, ca fi\u0219ierul s\u0103 fie cache-uit \u00een browserul vizitatorilor, ceea ce duce la o cerere mai mic\u0103 de l\u0103\u021bime de band\u0103 pe serverul dvs. web \u0219i la \u00eenc\u0103rcarea mai rapid\u0103 a paginilor pentru vizitatorii dvs.";
