    t[8296] = "This is the number of peers your router will use for network database inquiries. These are usually the <i>floodfill</i> routers which are responsible for maintaining network integrity. Your well integrated peers are shown on the bottom of the <a href='/profiles'>Profiles page</a>.";
    t[8297] = "Aceasta este num\u0103rul de participan\u021bi pe care routerul dvs. \u00eei va utiliza pentru interog\u0103ri ale bazei de date de re\u021bea. Ace\u0219tia sunt de obicei ruterele <i>floodfill</i> responsabile de men\u021binerea integrit\u0103\u021bii re\u021belei. Sponsorii dvs. bine integra\u021bi sunt afi\u0219a\u021bi \u00een partea de jos a <a href='/profiles'>paginii Profiluri</a>.";
    t[8298] = "Manage Router webapps";
    t[8299] = "Gestiona\u021bi Aplica\u021biile Web ale Routerului";
    t[8302] = "Outbound TCP from random high ports to arbitrary remote TCP ports.";
    t[8303] = "TCP de ie\u0219ire de la porturi \u00eenalte aleatoare c\u0103tre porturi TCP arbitrarie la distan\u021b\u0103.";
    t[8310] = "When you start I2P, it may take a few minutes to bootstrap (integrate) your router into the network and find additional peers, so please be patient.";
    t[8311] = "C\u00e2nd porni\u021bi I2P, este posibil s\u0103 dureze c\u00e2teva minute pentru a \u00eenc\u0103rca routerul (integra) routerul \u00een re\u021bea \u0219i pentru a g\u0103si colegi suplimentari, a\u0219a c\u0103 v\u0103 rug\u0103m s\u0103 ave\u021bi r\u0103bdare.";
