    t[8336] = "On the I2P network, remotely hosted services can be accessed using a <a href=https://en.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a> address ending in \".b32.i2p\", a <i>destination</i> represented as a long <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a> string, or more usually by using an .i2p domain. A destination is I2P's equivalent to an IP address, and is shown on the <a href='/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. You can share your b32.i2p address to allow others to access to your website until you've registered your own .i2p domain.";
    t[8337] = "Pe re\u021beaua I2P, serviciile g\u0103zduite \u00een mod remot pot fi accesate folosind o adres\u0103 <a href=https://en.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a> care se termin\u0103 in \".b32.i2p\", o destina\u021bie reprezentat\u0103 sub forma unui \u0219ir lung \u00een <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a> sau, mai des, folosind un domeniu .i2p. O destina\u021bie este echivalentul I2P pentru o adres\u0103 IP \u0219i este afi\u0219at\u0103 pe pagina de <a href='/i2ptunnel/edit?tunnel=3'>Configurare Manager Tunnels</a>. Pute\u021bi distribui adresa dvs. b32.i2p pentru a permite altor persoane s\u0103 acceseze site-ul dvs. p\u00e2n\u0103 c\u00e2nd \u00eenregistra\u021bi propriul domeniu .i2p.";
