    t[8410] = "To disable directory listings, find the entry for <code>org.eclipse.jetty.servlet.Default.dirAllowed</code> in the <code>base-context.xml</code> file, located in the <code>eepsite/contexts</code> folder (just above docroot folder), and change 'true' to 'false' immediately underneath. To apply the change immediately, stop and restart the <i>I2P Webserver</i> client on the <a href=/configclients>Client Configuration page</a>. You can also drop an empty <code>index.html</code> file in any exposed directory to suppress directory listings for that location.";
    t[8411] = "Pentru a dezactiva listarea directorului, g\u0103si\u021bi intrarea pentru <code>org.eclipse.jetty.servlet.Default.dirAllowed</code> \u00een fi\u0219ierul <code>base-context.xml</code>, situat \u00een dosarul <code>eepsite/contexts</code> (imediat deasupra dosarului docroot) \u0219i schimba\u021bi 'true' \u00een 'false' imediat sub acesta. Pentru a aplica schimbarea imediat, opri\u021bi \u0219i reporni\u021bi clientul <i>I2P Webserver</i> \u00een pagina <a href=/configclients>Configurare client</a>. De asemenea, pute\u021bi ad\u0103uga un fi\u0219ier <code>index.html</code> gol \u00een orice director expus pentru a suprima listarea directorului pentru acea loca\u021bie.";
