    t[8555] = "Dac\u0103 nu utiliza\u021bi IE, este posibil ca browser-ul se preface a fi IE, v\u0103 rug\u0103m s\u0103 configura\u021bi browser-ul dvs. (sau proxy) pentru a utiliza un alt agent utilizator dac\u0103 dori\u021bi s\u0103 accesa\u021bi consola temelor.";
