    t[8572] = "<a href=/logs>Logs</a> may help resolve a problem. You may wish to paste excerpts in a <a href=http://i2pforum.i2p/ target=_blank rel=noreferrer>forum</a> for help, or perhaps <a href=http://cake.i2p/pastebin/ target=_blank rel=noreferrer class='sitelink external'>paste</a> it instead and reference the link on IRC for help.";
    t[8573] = "Jurnalele pot ajuta la rezolvarea unei probleme. Pute\u021bi dori s\u0103 copia\u021bi extrase \u00eentr-un <a href=http://i2pforum.i2p/ target=_blank rel=noreferrer>forum</a> pentru ajutor, sau, eventual, s\u0103 le lipi\u021bi \u0219i s\u0103 furniza\u021bi link-ul pe IRC pentru ajutor.";
    t[8574] = "Plugins signed with the cryptographic key of the developer are the recommended format, but if you wish to install unsigned plugins (.zip) you can set this to true. Note that you may still encounter issues attempting to install an unsigned plugin if the developer has included additional checks in the plugin build process.";
    t[8575] = "Modulele suplimentare semnate cu cheia criptografic\u0103 a dezvoltatorului sunt formatul recomandat, dar dac\u0103 dori\u021bi s\u0103 instala\u021bi module suplimentare nesemnate (.zip) pute\u021bi seta acest parametru la true. Re\u021bine\u021bi c\u0103 s-ar putea s\u0103 \u00eent\u00e2mpina\u021bi probleme la \u00eencercarea de a instala un modul nesemnat dac\u0103 dezvoltatorul a inclus verific\u0103ri suplimentare \u00een procesul de creare al modulului suplimentar.";
    t[8578] = "If you are running a standalone Tor instance locally, you may use it by configuring I2P to use: <i>Proxy type:</i> <code>SOCKS 5</code> <i>Host:</i> <code>127.0.0.1</code> <i>Port:</i> <code>9050</code>.";
    t[8579] = "Dac\u0103 utiliza\u021bi local o instan\u021b\u0103 autonom\u0103 Tor, pute\u021bi utiliza aceasta prin configurarea I2P pentru a o utiliza: <i>Tip de proxy:</i> <code>SOCKS 5</code> <i>Gazd\u0103:</i> <code>127.0.0.1</code> <i>Port:</i> <code>9050</code>.";
    t[8584] = "Select the language to be used for the router console and web applications (<a href=/webmail target=_blank rel=noreferrer>webmail</a>, <a href=/torrents target=_blank rel=noreferrer>torrents</a>, <a href=/i2ptunnelmgr target=_blank rel=noreferrer>tunnel manager</a> etc). If you wish to change the language in future, change the router console theme, or configure a password to access the console, you may do so on the <a href=/configui target=_blank rel=noreferrer>User Interface configuration page</a>.";
    t[8585] = "Selecta\u021bi limba care va fi utilizat\u0103 pentru consola \u0219i aplica\u021biile web ale ruterei (<a href=/webmail target=_blank rel=noreferrer>webmail</a>, <a href=/torrents target=_blank rel=noreferrer>torrents</a>, <a href=/i2ptunnelmgr target=_blank rel=noreferrer>gestionar tunnel</a> etc). Dac\u0103 dori\u021bi s\u0103 schimba\u021bi limba \u00een viitor, s\u0103 schimba\u021bi tema consolei routerului sau s\u0103 configura\u021bi o parol\u0103 pentru a accesa consola, pute\u021bi face acest lucru pe pagina de configurare a <a href=/configui target=_blank rel=noreferrer>interfe\u021bei utilizatorului</a>.";
