    t[9056] = "These are the local services provided by your router. They may be clients started through the <a href='/i2ptunnelmgr'>Tunnel Manager</a> or external programs connecting through SAM, BOB, or directly to I2CP. By default, most of your client services (mail, http proxy, IRC) will share the same set of tunnels and be listed as <i>Shared Clients</i> and <i>Shared Clients(DSA)</i>, which enhances anonymity by blending the traffic from all shared services, and reduces the overhead required to build and maintain tunnels. However, if you experience a tunnel failure, all your services will go offline at the same time, so in some scenarios you may wish to configure client services to use their own set of tunnels. This can be done by unchecking the <i>Share tunnels with other clients&hellip;</i> option listed under <i>Shared Clients</i> on the configuration page of the relevant client service in the Tunnel Manager, after which you will need to restart the client service from the <a href='/i2ptunnelmgr'>main Tunnel Manager page</a>.";
    t[9057] = "Acestea sunt serviciile locale oferite de routerul dvs. Acestea pot fi clien\u021bi porni\u021bi prin intermediul <a href='/i2ptunnelmgr'>Managerului de tuneluri</a> sau programe externe care se conecteaz\u0103 prin intermediul SAM, BOB sau direct la I2CP. \u00cen mod implicit, majoritatea serviciilor clien\u021bilor dvs. (e-mail, proxy http, IRC) vor \u00eemp\u0103rt\u0103\u0219i aceea\u0219i serie de tunele \u0219i vor fi listate ca <i>Clien\u021bi partaja\u021bi</i> \u0219i <i>Clien\u021bi partaja\u021bi(DSA)</i>, ceea ce \u00eembun\u0103t\u0103\u021be\u0219te anonimatul prin amestecarea traficului de la toate serviciile partajate \u0219i reduce costurile necesare pentru construirea \u0219i \u00eentre\u021binerea tunelelor. Cu toate acestea, dac\u0103 \u00eent\u00e2mpina\u021bi o defec\u021biune a tunelului, toate serviciile dvs. vor fi offline \u00een acela\u0219i timp, astfel c\u0103 \u00een unele scenarii este posibil s\u0103 dori\u021bi s\u0103 configura\u021bi serviciile clien\u021bilor pentru a utiliza propriul set de tunele. Aceasta poate fi realizat\u0103 prin deselectarea op\u021biunii <i>\u00cemp\u0103rt\u0103\u0219i\u021bi tunelele cu al\u021bi clien\u021bi&hellip;</i> listat\u0103 sub <i>Clien\u021bi partaja\u021bi</i> pe pagina de configurare a serviciului client relevant \u00een Managerul de tuneluri, dup\u0103 care va trebui s\u0103 reporni\u021bi serviciul client din <a href='/i2ptunnelmgr'>pagina principal\u0103 a Managerului de tuneluri</a>.";
