    t[9138] = "If you'd like to report a bug, please file a ticket on <a href=https://github.com/I2PPlus/i2pplus/issues target=_blank rel=noreferrer class=sitelink>github.com/I2PPlus/i2pplus/issues</a>. For developer-related discussions, please visit <a href=http://zzz.i2p/ target=_blank rel=noreferrer class=sitelink>zzz's developer forums</a> or come and visit the <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>developer channel</a> on I2P's IRC network.";
    t[9139] = "Dac\u0103 dori\u021bi s\u0103 raporta\u021bi o eroare, v\u0103 rug\u0103m s\u0103 deschide\u021bi un tichet pe <a href=https://github.com/I2PPlus/i2pplus/issues target=_blank rel=noreferrer class=sitelink>github.com/I2PPlus/i2pplus/issues</a>. Pentru discu\u021bii legate de dezvoltatori, v\u0103 rug\u0103m s\u0103 vizita\u021bi <a href=http://zzz.i2p/ target=_blank rel=noreferrer class=sitelink>forumurile dezvoltatorilor lui zzz</a> sau s\u0103 veni\u021bi \u0219i s\u0103 vizita\u021bi <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>canalul dezvoltatorilor</a> pe re\u021beaua IRC I2P.";
