    t[9240] = "A simple CGI application that takes a hostname as a parameter and returns a 301 redirect to the proper URL with a <code>?i2paddresshelper=key</code> string appended. The HTTP proxy will interpret the appended string and use the key as the actual destination. In addition, the proxy will cache the key so the address helper is not necessary until restart, and offer the option to add the resolved address to the addressbook.";
    t[9241] = "O aplica\u021bie CGI simpl\u0103 care accept\u0103 un hostname ca parametru \u0219i returneaz\u0103 o redirec\u021bionare 301 c\u0103tre URL-ul corect cu o string-uri <code>?i2paddresshelper=key</code> ad\u0103ugat\u0103. Proxy-ul HTTP va interpreta string-ul ad\u0103ugat \u0219i va folosi cheia ca destina\u021bie real\u0103. \u00cen plus, proxy-ul va memora cheia astfel \u00eenc\u00e2t asistentul de adres\u0103 s\u0103 nu fie necesar p\u00e2n\u0103 la repornire \u0219i va oferi op\u021biunea de ad\u0103ugare a adresei rezolvate \u00een agenda de adrese.";
