    t[9292] = "This setting (in minutes) allows you to manually configure how long to wait after startup before RouterInfos in the NetDb are checked for validity, after which point only valid routers will be accepted for inclusion. When the validation occurs, expired RouterInfos and unresponsive peers only accessible via SSU will be removed from the NetDb. [Default is 60 minutes] Note: This setting has no bearing on older routers (older than 0.9.29 by default) which are removed from the NetDb and banned for the router session as soon as a NetDb store is attempted.";
    t[9293] = "Aceast\u0103 setare (\u00een minute) v\u0103 permite s\u0103 configura\u021bi manual c\u00e2t timp s\u0103 se a\u0219tepte dup\u0103 pornirea routerelor RouterInfos \u00een NetDb p\u00e2n\u0103 c\u00e2nd numai ruterele valide vor fi acceptate pentru includere. \u00cen momentul \u00een care are loc validarea, RouterInfos expirate \u0219i peerii neaccesibili doar prin SSU vor fi eliminate din NetDb. [Implicit este de 60 de minute] Not\u0103: Aceast\u0103 setare nu are nicio influen\u021b\u0103 asupra routerelor mai vechi (mai vechi de 0.9.29 implicit) care sunt eliminate din NetDb \u0219i interzise pentru sesiunea routerului din momentul \u00een care se \u00eencearc\u0103 stocarea \u00een NetDb.";
