    t[9326] = "The router's external port allows communication with other routers. It is recommended to configure your firewall to allow inbound and outbound traffic on this port to optimize your router's performance on the network.";
    t[9327] = "Portul extern al routerului permite comunicarea cu alte routere. Este recomandat s\u0103 configura\u021bi firewall-ul pentru a permite traficul de intrare \u0219i de ie\u0219ire pe acest port pentru a optimiza performan\u021ba routerului \u00een re\u021bea.";
