    t[9354] = "Reseeding is the bootstrapping process used to find other routers when you first install I2P, or when your router has too few router references remaining. The default settings will work for most people. Change these only if HTTPS is blocked by a restrictive firewall and reseed has failed.";
    t[9355] = "Resetarea este procesul de ini\u021bializare utilizat pentru g\u0103sirea altor routere c\u00e2nd instalezi pentru prima dat\u0103 I2P, sau c\u00e2nd routerul t\u0103u are prea pu\u021bine referin\u021be la routere r\u0103mase. Set\u0103rile implicite vor func\u021biona pentru majoritatea oamenilor. Modific\u0103-le doar dac\u0103 HTTPS este blocat de un firewall restrictiv \u0219i resetarea a e\u0219uat.";
    t[9362] = "This setting, when enabled, modifies the maximum additional random pong delay introduced for ping-enabled servers, if <code>i2p.streaming.enablePongDelay</code> is also enabled. Unless explicitly set, the default value of 50ms will be used.";
    t[9363] = "Aceast\u0103 setare, atunci c\u00e2nd este activat\u0103, modific\u0103 \u00eent\u00e2rzierea de pong aleatoare maxim\u0103 adi\u021bional\u0103 introdus\u0103 pentru serverele activate pentru ping, dac\u0103 <code>i2p.streaming.enablePongDelay</code> este, de asemenea, activat. Dac\u0103 nu este setat\u0103 \u00een mod explicit, se va folosi valoarea implicit\u0103 de 50ms.";
