    t[9466] = "This may be a transient error, if the other program is no longer using the port.";
    t[9467] = "Acest lucru poate fi o eroare tranzitorie, dac\u0103 alt program nu mai folose\u0219te portul.";
    t[9474] = "Your I2P+ router by default contributes to the network by routing internal, end-to-end encrypted traffic for other routers, known as <i>participation</i>. Bandwidth participation improves the anonymity level of all users on the network and maximizes your download speed.";
    t[9475] = "Ruterul I2P+ contribuie, \u00een mod implicit, la re\u021bea prin dirijarea traficului intern cifrat de la un cap\u0103t la altul pentru al\u021bi rutere, cunoscut\u0103 sub denumirea de <i>participare</i>. Participarea la l\u0103\u021bimea de band\u0103 \u00eembun\u0103t\u0103\u021be\u0219te nivelul de anonimat al tuturor utilizatorilor din re\u021bea \u0219i maximizeaz\u0103 viteza de desc\u0103rcare.";
    t[9476] = "This setting permits the configuration of alternative NTP servers required to ensure that your router maintains accurate clock time. [Default is 0.pool.ntp.org,1.pool.ntp.org,2.pool.ntp.org]";
    t[9477] = "Aceast\u0103 setare permite configurarea serverelor alternative NTP necesare pentru a asigura c\u0103 routerul dvs. men\u021bine ora exact\u0103. [Implicit este 0.pool.ntp.org,1.pool.ntp.org,2.pool.ntp.org]";
    t[9484] = "Optimize your images";
    t[9485] = "Optimiza\u021bi imaginile";
    t[9488] = "Note that the profiler relies on sustained client tunnel usage to accurately profile peers.";
    t[9489] = "Re\u021bine\u021bi c\u0103 profilerul se bazeaz\u0103 pe utilizarea sus\u021binut\u0103 a tunelului clientului pentru a profila cu exactitate pee\u021bii.";
    t[9492] = "If you are in a hurry and can't wait a few hours, you can tell people to use a \"jump\" address helper redirection service. This will usually work within a few minutes of your registering your hostname on the same site. Test it yourself first by entering <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>yourchosenhostname.i2p</i></code> into your browser. Once it is working, you can tell others to use it.";
    t[9493] = "Dac\u0103 v\u0103 gr\u0103bi\u021bi \u0219i nu pute\u021bi a\u0219tepta c\u00e2teva ore, pute\u021bi le pute\u021bi spune oamenilor s\u0103 utilizeze un serviciu de redirec\u021bionare ajutatoare a adresei \u201ejump\u201d. Aceasta de obicei va func\u021biona \u00een c\u00e2teva minute de la \u00eenregistrarea numelui de gazd\u0103 pe acela\u0219i site. Testa\u021bi mai \u00eent\u00e2i p\u0103trunz\u00e2nd <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>yourchosenhostname.i2p</i></code> \u00een browser. Odat\u0103 ce func\u021bioneaz\u0103, pute\u021bi spune \u0219i altora s\u0103 \u00eel utilizeze.";
