    t[9580] = "Note that the full path to the output files must be accessible before deploying the filter. If the target directory does not exist, the destinations will not be recorded and an error will appear in the router logs. The files will be created as required. The examples provided above are not recommendations; your configuration should be tuned according to the amount of content (number and size of files) your site is serving, the speed of the server, and the frequency with which the site is updated. Configuring recorders and monitoring the resulting files will help you fine tune the settings.";
    t[9581] = "Re\u021bine\u021bi c\u0103 calea complet\u0103 c\u0103tre fi\u0219ierele de ie\u0219ire trebuie s\u0103 fie accesibil\u0103 \u00eenainte de implementarea filtrului. Dac\u0103 directorul \u021bint\u0103 nu exist\u0103, destina\u021biile nu vor fi \u00eenregistrate \u0219i va ap\u0103rea o eroare \u00een jurnalele ruterului. Fi\u0219ierele vor fi create dup\u0103 nevoie. Exemplele de mai sus nu sunt recomand\u0103ri; configura\u021bia dvs. ar trebui ajustat\u0103 \u00een func\u021bie de cantitatea de con\u021binut (num\u0103rul \u0219i dimensiunea fi\u0219ierelor) pe care site-ul dvs. le serve\u0219te, viteza serverului \u0219i frecven\u021ba cu care site-ul este actualizat. Configurarea \u00eenregistratorilor \u0219i monitorizarea fi\u0219ierelor rezultate v\u0103 vor ajuta s\u0103 ajusta\u021bi set\u0103rile.";
