    t[9630] = "Tunnels built by other routers through your router. This may vary widely depending on network demand, your shared bandwidth, and amount of locally-generated traffic. The recommended method for limiting participating tunnels is to change your share percentage on the <a  href='/config'>Bandwidth Configuration page</a>. You may also limit the total number by setting <code>router.maxParticipatingTunnels=nnn</code> on the <a href='/configadvanced'>Advanced configuration page</a>. <a href='/configstats#tunnel.participatingTunnels'>[Enable graphing]</a>.";
    t[9631] = "Tunelurile construite de alte rutere prin intermediul ruterului dumneavoastr\u0103. Acest lucru poate varia \u00een mod semnificativ \u00een func\u021bie de cererea re\u021belei, l\u0103\u021bimea de band\u0103 partajat\u0103 \u0219i cantitatea de trafic generat\u0103 local. Metoda recomandat\u0103 pentru limitarea tunelurilor participante este s\u0103 modifici procentul de partajare pe pagina de <a href='/config'>Configurare a l\u0103\u021bimii de band\u0103</a>. De asemenea, pute\u021bi limita num\u0103rul total set\u00e2nd <code>router.maxParticipatingTunnels=nnn</code> pe pagina de <a href='/configadvanced'>Configurare avansat\u0103</a>. <a href='/configstats#tunnel.participatingTunnels'>[Permite graficul]</a>.";
