    t[10038] = "To configure an alternative webserver for use on I2P, you can either use the existing webserver tunnel and <a href=/configclients>disable the default webserver</a> from running, or create a new HTTP Server tunnel in the <a href=/i2ptunnelmgr>Tunnel Manager</a>. Ensure that the webserver's <i>listening port</i> is also configured in the Tunnel Manager settings. For example, if your webserver is listening by default on address 127.0.0.1 port 80, you'd also need to ensure that the <i>Target port</i> in the Tunnel Manager settings page for the service is also configured to port 80.";
    t[10039] = "Pentru a configura un server web alternativ pentru utilizarea \u00een I2P, pute\u021bi utiliza fie tunelul serverului web existent \u0219i <a href=/configclients>dezactiva\u021bi serverul web implicit</a> s\u0103 ruleze sau s\u0103 crea\u021bi un nou tunel server HTTP \u00een <a href=/i2ptunnelmgr>Managerul de tuneluri</a>. Asigura\u021bi-v\u0103 c\u0103 <i>portul de ascultare</i> al serverului web este de asemenea configurat \u00een set\u0103rile Tunelului Managerului. De exemplu, dac\u0103 serverul web ascult\u0103 implicit pe adresa 127.0.0.1 portul 80, trebuie s\u0103 v\u0103 asigura\u021bi c\u0103 <i>portul \u021bint\u0103</i> \u00een pagina de set\u0103ri a Tunelului Managerului pentru serviciu este de asemenea configurat pe portul 80.";
