    t[10045] = "Proxy IRC";
    t[10046] = "An I2P router usually only needs to be seeded once, to join the network for the first time. However, if the router is running for an extended period without network connectivity it may also need to be reseeded. Reseeding involves fetching multiple \"RouterInfo\" files (bundled into a signed zip-file) from at least two predefined server URLs picked from a volunteer-run group of clearnet HTTPS servers.";
    t[10047] = "De obicei, un router I2P trebuie s\u0103 fie sem\u0103nat o singur\u0103 dat\u0103, pentru a se al\u0103tura re\u021belei pentru prima dat\u0103. Cu toate acestea, dac\u0103 routerul ruleaz\u0103 o perioad\u0103 extins\u0103 f\u0103r\u0103 conectivitate la re\u021bea, este posibil s\u0103 fie necesar\u0103 recoltarea. Recoltarea implic\u0103 extragerea a mai multor fi\u0219iere \u201eRouterInfo\u201d (\u00eempachetate \u00eentr-un fi\u0219ier zip semnat) de la cel pu\u021bin dou\u0103 adrese URL prestabilite preluate dintr-un grup de servere HTTPS de pe clearnet gestionate de voluntari.";
    t[10050] = "Are you sure you want to delete {0}?";
    t[10051] = "Sunte\u021bi sigur c\u0103 dori\u021bi s\u0103 \u0219terge\u021bi {0}?";
