    t[10055] = "Examina\u021bi actualiz\u0103rile recente ale I2P";
    t[10062] = "This setting determines the delay between peer test jobs, configured in milliseconds. [Default is 5000]";
    t[10063] = "Aceast\u0103 setare determin\u0103 \u00eent\u00e2rzierea \u00eentre sarcinile de testare peer, configurat\u0103 \u00een milisecunde. [Valoarea implicit\u0103 este 5000]";
    t[10072] = "A guide to reseeding the router";
