    t[10076] = "A list of countries derived from the <a href=https://freedomhouse.org/report/countries-world-freedom-2019 class='sitelink external' target=_blank rel=noreferrer>World Freedom Report</a> with a poor civil liberties reputation. This list is used to place routers running in the specified countries in <i>Hidden Mode</i> to provide enhanced security for users. The following countries are designated as strict: Afghanistan, Azerbaijan, Bahrain, Belarus, Brunei, Burundi, Cameroon, Central African Republic, Chad, China, Cuba, Democratic Republic of the Congo, Egypt, Equatorial Guinea, Eritrea, Ethiopia, Iran, Kazakhstan, Laos, Libya, Myanmar, North Korea, Palestinian Territories, Rwanda, Saudi Arabia, Somalia, South Sudan, Sudan, Eswatini (Swaziland), Syria, Tajikistan, Thailand, Turkey, Turkmenistan, Venezuela, United Arab Emirates, Uzbekistan, Western Sahara, Yemen.";
    t[10077] = "O list\u0103 de \u021b\u0103ri derivate din <a href=https://freedomhouse.org/report/countries-world-freedom-2019 class='sitelink external' target=_blank rel=noreferrer>Raportul Mondial al Liber\u021b\u0103\u021bii</a> cu o reputa\u021bie proast\u0103 \u00een privin\u021ba libert\u0103\u021bilor civile. Aceast\u0103 list\u0103 este utilizat\u0103 pentru a plasa ruterele care ruleaz\u0103 \u00een \u021b\u0103rile specificate \u00een <i>Hidden Mode</i> pentru a oferi utilizatorilor o securitate sporit\u0103. Urm\u0103toarele \u021b\u0103ri sunt desemnate ca strict: Afganistan, Azerbaidjan, Bahrain, Belarus, Brunei, Burundi, Camerun, Republica Centrafrican\u0103, Ciad, China, Cuba, Republica Democrat\u0103 Congo, Egipt, Guinea Ecuatorial\u0103, Eritreea, Etiopia, Iran, Kazahstan, Laos, Libia, Myanmar, Coreea de Nord, Teritoriile Palestiniene, Rwanda, Arabia Saudit\u0103, Somalia, Sudanul de Sud, Sudan, Eswatini (Swaziland), Siria, Tadjikistan, Thailanda, Turcia, Turkmenistan, Venezuela, Emiratele Arabe Unite, Uzbekistan, Sahara Occidental\u0103, Yemen.";
