    t[10318] = "Where possible, please ensure I2P+/Java is allowed bi-directional port access from the internet by configuring your modem/router/pc firewall accordingly. If you're behind a prohibitive firewall but have unrestricted outbound access, I2P+ can still function; you can turn off inbound access and rely on <a href=http://i2p-projekt.i2p/udp.html target=_blank rel=noreferrer class=sitelink>SSU IP Address Detection</a> (<a href=https://wikipedia.org/wiki/Hole_punching target=_blank rel=noreferrer class='sitelink external'>firewall hole punching</a>) to connect you to the network, and your network status in the side panel will indicate \"Status: Firewalled\". For optimal performance, please ensure I2P's <a href=/confignet#udpconfig>external port</a> is visible from the internet (see below for more information).";
    t[10319] = "Dac\u0103 este posibil, asigura\u021bi-v\u0103 c\u0103 I2P+/Java are permisiune de acces bidirec\u021bional la porturi din internet prin configurarea corespunz\u0103toare a modemului/routarului/firewallului PC. Dac\u0103 sunte\u021bi \u00een spatele unui firewall restrictiv, dar ave\u021bi acces nelimitat \u00een exterior, I2P+ poate func\u021biona \u00een continuare; pute\u021bi dezactiva accesul prin intrare \u0219i v\u0103 pute\u021bi baza pe <a href=http://i2p-projekt.i2p/udp.html target=_blank rel=noreferrer class=sitelink>Detectarea adresei IP SSU</a> (<a href=https://wikipedia.org/wiki/Hole_punching target=_blank rel=noreferrer class='sitelink external'>g\u0103urirea firewall-ului</a>) pentru a v\u0103 conecta la re\u021bea \u0219i starea re\u021belei din panoul lateral va indica \u201eStatus: Firewalled\u201d. Pentru performan\u021b\u0103 optim\u0103, asigura\u021bi-v\u0103 c\u0103 <a href=/confignet#udpconfig>portul extern</a> al I2P-ului este vizibil din internet (vezi mai jos pentru mai multe informa\u021bii).";
