    t[10636] = "Jurist";
    t[10637] = "Jurist";
    t[10644] = "Skip Setup";
    t[10645] = "Sari peste configurare";
    t[10650] = "Duplicate packets received from peer";
    t[10651] = "Pachete duplicate primite de la peer";
    t[10660] = "Services may be hosted on multiple routers simultaneously, by sharing the same private key for the destination. Multihoming can further enhance the security and stability of a server by providing redundancy; if a server is multihomed, when a server in the pool goes offline, the provided service will remain available, making it more difficult to correlate server downtime with a router going offline.";
    t[10661] = "Serviciile pot fi g\u0103zduite simultan pe mai multe rutere, prin partajarea aceleia\u0219i chei private pentru destina\u021bie. Multihoming-ul poate \u00eembun\u0103t\u0103\u021bi \u00een continuare securitatea \u0219i stabilitatea unui server prin furnizarea de redundant\u0103; dac\u0103 un server are mai multe loca\u021bii, atunci c\u00e2nd un server din pool se deconecteaz\u0103, serviciul oferit va r\u0103m\u00e2ne disponibil, ceea ce face mai dificil\u0103 corelarea indisponibilit\u0103\u021bii serverului cu oprirea unui router.";
    t[10672] = "Client Configuration";
    t[10673] = "Configurare client";
    t[10674] = "Ensure your Java is up to date. Version 1.8 or higher is required; version 11 or higher is recommended. Check your Java version at the top of <a href=/info>the router information page</a>.";
    t[10675] = "Asigura\u021bi-v\u0103 c\u0103 versiunea Java este actualizat\u0103. Este necesar\u0103 versiunea 1.8 sau ulterioar\u0103; se recomand\u0103 versiunea 11 sau ulterioar\u0103. Verifica\u021bi versiunea Java pe partea de sus a <a href=/info>paginii de informa\u021bii despre router</a>.";
    t[10678] = "I2CP Interface";
    t[10679] = "Interfa\u021b\u0103 I2CP";
