    t[10707] = "Ei sau oferit s\u0103 ne introduc\u0103";
    t[10708] = "Performing a soft restart";
    t[10709] = "Efectuarea unei reporniri soft";
    t[10710] = "The process of acquiring router identities, normally via <i>clearnet</i> servers, to ensure your router can communicate and build tunnels with other routers on the network. When a router has no router identities for other peers (usually immediately after installation), the process of reseeding is also referred to as <i>bootstrapping</i>.";
    t[10711] = "Procesul de ob\u021binere a identit\u0103\u021bilor rutere, de obicei prin intermediul serverelor <i>clearnet</i>, pentru a v\u0103 asigura c\u0103 ruterul dvs. poate comunica \u0219i construi tuneluri cu alte rutere din re\u021bea. Atunci c\u00e2nd un ruter nu are identit\u0103\u021bi de rutere pentru al\u021bi participan\u021bi (de obicei imediat dup\u0103 instalare), procesul de res\u0103dire este numit \u0219i <i>bootstrapping</i>.";
    t[10712] = "Direction/Introduction";
