    t[10718] = "NTCP";
    t[10719] = "NTCP";
    t[10730] = "ANONYMITY WARNING - Settings include 0-hop tunnels.";
    t[10731] = "AVERTIZARE ANONIMITATE - Set\u0103rile includ tunele 0-hop.";
    t[10734] = "URL list reset successfully";
    t[10735] = "List\u0103 URL resetat\u0103 cu succes";
