    t[10739] = "TheAtlantic";
    t[10740] = "Warning: could not set the I2P+ service to autostart";
    t[10741] = "Avertisment: nu a putut seta serviciul I2P la pornire automat\u0103";
    t[10746] = "A tunnel used by the router for communicating with other routers to perform various \"housekeeping\" functions such as learning and publishing <i>leasesets</i>, testing client tunnels, and learning about and validating other routers in the network. These tunnels are normally low-bandwidth.";
    t[10747] = "Un tunel utilizat de rutere pentru a comunica cu alte rutere pentru a efectua diverse func\u021bii de \"men\u021binere\" precum \u00eenv\u0103\u021barea \u0219i publicarea seturilor de aloc\u0103ri (leasesets), testarea tunelurilor de clien\u021bi \u0219i \u00eenv\u0103\u021barea \u0219i validarea altor rutere din re\u021bea. Aceste tuneluri au de obicei o l\u0103\u021bime de band\u0103 redus\u0103.";
    t[10752] = "Debug";
