    t[11024] = "By default, I2P will use the system configured default browser to launch at startup. If you wish to nominate an alternative browser, you will need to edit your router.config file (or the <a href=/configadvanced>Advanced Configuration page</a> if you have enabled advanced console mode) and add a new configuration line <code>routerconsole.browser=/path/to/browser</code> or <code>routerconsole.browser=\\path\\to\\browser.exe</code> if using Windows, replacing <code>\\path\\to\\browser</code> with the location of the browser you wish to use. Note: If the path to your chosen browser contains spaces, you may need to encase the path in quotes e.g. <code>routerconsole.browser=\"C:\\Program Files\\Mozilla\\Firefox.exe\"</code>";
    t[11025] = "\u00cen mod implicit, I2P va folosi browserul implicit configurat \u00een sistem pentru a se lansa la pornire. Dac\u0103 dori\u021bi s\u0103 specifica\u021bi un browser alternativ, va trebui s\u0103 edita\u021bi fi\u0219ierul router.config (sau pagina <a href=/configadvanced>Configurare avansat\u0103</a> dac\u0103 a\u021bi activat modul consol\u0103 avansat) \u0219i ad\u0103uga\u021bi o nou\u0103 linie de configurare <code>routerconsole.browser=/cale/c\u0103tre/browser</code> sau <code>routerconsole.browser=\\cale\\c\u0103tre\\browser.exe</code> \u00een cazul utiliz\u0103rii Windows, \u00eenlocuind <code>\\cale\\c\u0103tre\\browser</code> cu loca\u021bia browserului pe care dori\u021bi s\u0103 o utiliza\u021bi. Not\u0103: Dac\u0103 calea c\u0103tre browserul ales con\u021bine spa\u021bii, s-ar putea s\u0103 ave\u021bi nevoie s\u0103 \u00eenconjura\u021bi calea cu ghilimele, de exemplu <code>routerconsole.browser=\"C:\\Program Files\\Mozilla\\Firefox.exe\"</code>.";
