    t[11106] = "This setting (in hours) allows you to manually configure how old a RouterInfo is in order for it to be checked by the Refresh Routers Job. By default, the age of a RouterInfo before a refresh is intitiated scales according to the size of the NetDb, increasing as the NetDb grows in size. A value of 0 will force the Router Refresh Job to check every router in the NetDb, regardless of age.";
    t[11107] = "Aceast\u0103 setare (\u00een ore) v\u0103 permite s\u0103 configura\u021bi manual c\u00e2t de vechi trebuie s\u0103 fie un RouterInfo pentru ca acesta s\u0103 fie verificat de jobul Refresh Routers. \u00cen mod implicit, v\u00e2rsta unui RouterInfo \u00eenainte de o re\u00eemprosp\u0103tare este scalat\u0103 \u00een func\u021bie de dimensiunea NetDb, cres\u00eend pe m\u0103sur\u0103 ce NetDb cre\u0219te. O valoare de 0 va for\u021ba jobul de actualizare a rutereului (Router Refresh Job) s\u0103 verifice fiecare router din NetDb, indiferent de v\u00e2rst\u0103.";
    t[11112] = "Show all members of the {0} family in NetDb";
