    t[11128] = "An I2P web application that manages service destinations for the network, mapping B64 hashes to human-readable names. Destinations may be added manually, or via subscriptions to hosts.txt files. Also referred to as SusiDNS. For more information, see the <a href=https://geti2p.net/en/docs/naming class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[11129] = "O aplica\u021bie web I2P care gestioneaz\u0103 destina\u021biile serviciului pentru re\u021bea, realiz\u00e2nd map\u0103ri \u00eentre hash-urile B64 \u0219i nume u\u0219or de citit. Destina\u021biile pot fi ad\u0103ugate manual sau prin abonare la fi\u0219ierele hosts.txt. Este denumit\u0103 \u0219i SusiDNS. Pentru mai multe informa\u021bii, consulta\u021bi <a href=https://geti2p.net/en/docs/naming class='sitelink external' target=_blank rel=noreferrer>documenta\u021bia online</a>.";
