    t[11516] = "In order to use a single set of tunnels for multiple client services, clients can be configured from the <i>Tunnel Manager</i> to operate in <i>Shared Client</i> mode. This mode conserves resources and blends the traffic from multiple clients into a single set of tunnels, making traffic analysis harder. Clients configured as Shared Clients share the same tunnel options.";
    t[11517] = "Pentru a utiliza un singur set de tunele pentru mai multe servicii client, clien\u021bii pot fi configura\u021bi din <i>Tunnel Manager</i> pentru a func\u021biona \u00een modul <i>Shared Client</i>. Acest mod conserveaz\u0103 resursele \u0219i amestec\u0103 traficul de la mai mul\u021bi clien\u021bi \u00eentr-un singur set de tunele, f\u0103c\u00e2nd analiza traficului mai dificil\u0103. Clien\u021bii configura\u021bi ca Shared Clients \u00eemp\u0103rt\u0103\u0219esc acelea\u0219i op\u021biuni de tunele.";
