    t[11658] = "Your modem or router may support <a href=https://wikipedia.org/wiki/Universal_Plug_and_Play target=_blank rel=noreferrer>Universal Plug &amp; Play</a> (UPnP), which permits automatic port forwarding. Ensure UPnP support for I2P+ is enabled on the <a href=/confignet>config page</a>, then try to activate UPnP on your modem/router and possibly your computer also. Now try restarting the <a href=/>I2P+ router</a>. If successful, I2P+ should report \"Status: OK\" in the side panel once the I2P+ router completes initial connectivity tests.";
    t[11659] = "Modemul sau routerul dvs. poate suporta <a href=https://wikipedia.org/wiki/Universal_Plug_and_Play target=_blank rel=noreferrer>Universal Plug &amp; Play</a> (UPnP), care permite redirec\u021bionarea automat\u0103 a porturilor. Asigura\u021bi-v\u0103 c\u0103 suportul UPnP pentru I2P+ este activat pe <a href=/confignet>pagina de configurare</a>, apoi \u00eencerca\u021bi s\u0103 activa\u021bi UPnP pe modem/router \u0219i posibil \u0219i pe computerul dvs. \u00cencerca\u021bi acum s\u0103 reporni\u021bi <a href=/>ruterul I2P+</a>. Dac\u0103 reu\u0219i\u021bi, I2P+ ar trebui s\u0103 raporteze \u201eStatus: OK\u201d \u00een panoul lateral dup\u0103 ce ruterul I2P+ completeaz\u0103 testele ini\u021biale de conectivitate.";
