    t[11950] = "F.A.Q.";
    t[11951] = "\u00centreb\u0103ri frecvente";
    t[11962] = "Peers marked as high capacity that also meet or exceed speed average for all profiled peers.";
    t[11963] = "Colegii marca\u021bi ca de mare capacitate care ating sau dep\u0103\u0219esc, de asemenea, viteza medie pentru to\u021bi colegii profila\u021bi.";
    t[11964] = "Local connection to wrapper control channel port";
    t[11965] = "Conexiune local\u0103 la portul canalului de control al \u00eempachet\u0103rii";
    t[11982] = "If your TCP port is firewalled with inbound TCP enabled, routers will not be able to contact you via TCP, which will hurt the network.";
    t[11983] = "Dac\u0103 portul TCP este in spatele unui firewall cu intrarea TCP-ului, routerele nu vor fi \u00een m\u0103sur\u0103 s\u0103 v\u0103 contacteze prin intermediul TCP, care vor r\u0103ni re\u021bea.";
    t[11984] = "Local Identity";
    t[11985] = "Identitate local\u0103";
    t[11994] = "While I2P will work fine behind most firewalls, your speeds and network integration will generally improve if the I2P port is forwarded for both UDP and TCP.";
    t[11995] = "\u00cen timp ce I2P va func\u021biona bine \u00een spatele majorit\u0103\u021biilor tipurilor de firewall, viteza de integrare in re\u021bea se va \u00eembun\u0103t\u0103\u021bi, \u00een cazul, \u00een care portul I2P este transmis at\u00e2t prin UDP cat \u0219i TCP.";
    t[12002] = "Shared Clients";
    t[12003] = "Clien\u021bi partaja\u021bi";
    t[12006] = "Configuration files for the router, installed plugins, and router logs are stored in the following location:";
    t[12007] = "Fi\u0219ierele de configurare pentru router, plugin-uri instalate \u0219i jurnalele routerului sunt stocate \u00een urm\u0103toarea loca\u021bie:";
