    t[12018] = "Permanently banned";
    t[12019] = "Interzis permanent";
    t[12020] = "Tunnels longer than 3 hops (for example 2 hops + 0-2 hops, 3 hops + 0-1 hops, 3 hops + 0-2 hops), or a high quantity + backup quantity, may severely reduce performance or reliability.";
    t[12021] = "Tuneluri mai lungi de 3 hops (de exemplu, 2 hops + 0-2 hops, 3 hops + 0-1 hops, 3 hops + 0-2 hops), sau o cantitate mare + cantitate de rezerv\u0103, poate reduce drastic performanta sau fiabilitatea.";
    t[12022] = "Sidebar";
    t[12023] = "Bara lateral\u0103";
    t[12024] = "A router that facilitates the connection to the network of another router that is behind a firewall.";
    t[12025] = "Un router care faciliteaz\u0103 conexiunea la re\u021beaua altui router care este amplasat \u00een spatele unui firewall.";
    t[12026] = "I2P FAQ";
    t[12027] = "I2P FAQ";
    t[12028] = "If you hover over the <i>Router Info</i> heading, your truncated router identity will be shown (the first four characters (24 bits) of your 44-character (256-bit) Base64 router hash). The full hash is shown on your <a href='netdb?r=.'>Network Database entry</a>. Never reveal this to anyone, as your router identity is uniquely linked to your IP address in the network database.";
    t[12029] = "Dac\u0103 plasa\u021bi cursorul pe titlul <i>Informa\u021bii despre router</i>, va fi afi\u0219at\u0103 identitatea dumneavoastr\u0103 de router trunchiat\u0103 (primele patru caractere (24 de bi\u021bi) din valoarea router hash \u00een format Base64 de 44 de caractere (256 bi\u021bi)). Valoarea complet\u0103 a hashului este afi\u0219at\u0103 \u00een <a href='netdb?r=.'>intrarea de baz\u0103 a bazei de date de re\u021bea</a>. Nu dezv\u0103lui\u021bi aceast\u0103 informa\u021bie nim\u0103nui, deoarece identitatea dumneavoastr\u0103 de router este legat\u0103 \u00een mod unic de adresa IP \u00een baza de date de re\u021bea.";
    t[12030] = "Previous";
