    t[12033] = "Router oprit";
    t[12038] = "Directory listings (sometimes referred to as virtual directories) are enabled by default, so you can host files from a sub-directory of <code>docroot</code> without providing a page with links to the files. You can also serve content that exists outside of <code>docroot</code> by using a <a href=https://en.wikipedia.org/wiki/Symbolic_link target=_blank rel=noreferrer class='sitelink external'>symbolic link</a> to the desired directory.";
    t[12039] = "Listele de directoare (uneori denumite directoare virtuale) sunt activate \u00een mod implicit, astfel \u00eenc\u00e2t pute\u021bi g\u0103zdui fi\u0219iere dintr-un subdirector al <code>docroot</code> f\u0103r\u0103 a furniza o pagin\u0103 cu linkuri c\u0103tre fi\u0219iere. De asemenea, pute\u021bi servi con\u021binut care exist\u0103 \u00een afara <code>docroot</code> folosind un <a href=https://en.wikipedia.org/wiki/Symbolic_link target=_blank rel=noreferrer class='sitelink external'>link simbolic</a> c\u0103tre directorul dorit.";
