    t[12062] = "Using the <i class=example>explicit</i> directive, a threshold can be applied to a remote destination listed in the definition itself, with the option to specify custom thresholds for multiple destinations. Remote destinations can also be excluded from the default threshold using the <i class=example>allow</i> keyword, or permanently blocked using the <i class=example>deny</i> keyword:";
    t[12063] = "Utiliz\u00e2nd directorul <i class=example>explicit</i>, se poate aplica un prag pentru o destina\u021bie remote listat\u0103 \u00een defini\u021bie \u00eens\u0103\u0219i, cu op\u021biunea de a specifica praguri personalizate pentru mai multe destina\u021bii. Destina\u021biile remote pot fi, de asemenea, excluse de la pragul implicit folosind cuv\u00e2ntul cheie <i class=example>allow</i>, sau blocate permanent folosind cuv\u00e2ntul cheie <i class=example>deny</i>:";
